'–ø—Ä–µ–∂–¥–µ —á–µ–º —Ç–≤–æ—è –º–∞—Ç—å –Ω–∞—á–∏–Ω–∞–µ—Ç —Å–æ—Å–∞—Ç—å —è –±—å—é –µ–π —Ö—É—ë–º –ø–æ –≥—É–±–µ –µ–π –Ω—Ä–∞–≤–∏—Ç—å—Å—è –≤–µ–¥—å —ç—Ç–æ –ø–∞—Å—Ç–∞ –¥–∞–≤–Ω–æ –≤–æ –≤–ª–∞—Å—Ç–∏ –º–æ–µ–≥–æ —Ö—É—è',
'—Ç—ã –¥–∞–∂–µ –Ω–µ –∑–∞–º–µ—Ç–∏—à—å –∫–∞–∫ —Ç–≤–æ—è –º–∞—Ç—å –Ω–∞ –º–æ–π —Ö—É–π –∂–∏—Ç—å –ø–µ—Ä–µ–µ–¥–µ—Ç',
'—Ç–≤–æ—è –º–∞—Ç—å —â–∞ –º–æ–π —Ö—É–π —Ä–µ—à–∏–ª–∞ –≤ –º—É–∑–µ–π –ø—Ä–µ–Ω–µ—Å—Ç–∏ –∏ —Å–∫–∞–∑–∞—Ç—å —á—Ç–æ —ç—Ç–æ –≤–µ–ª–∏–∫–∏–π –∞—Ä—Ç–µ—Ñ–∞–∫—Ç —á—ë –æ–Ω–∞ —à–∞–ª–æ–≤–∞ —Ç–æ —Ç–∞–∫–∞—è',
'–±–µ–∑ —à—É—Ç–æ–∫ –µ—Å–ª–∏ —Ç–≤–æ—è –º–∞—Ç—å –Ω–µ –Ω–∞—á–Ω—ë—Ç –≤ —Ç–µ–º–ø–µ —Å–æ—Å–∞—Ç—å —è –µ–π –∑–∞–ª—É–ø–æ–π –ø–æ –µ–±–∞–ª—É —Å–µ–∑–∂—É',
'–∏ —á—ë —Ç—ã —â–∞—Å —Ç–æ–∂–µ –±—É–¥–µ—à—å –æ—Ç —Ö—É—è —É–≤–∏–ª–∏–≤–∞—Ç—å –∫–∞–∫ —Ç–≤–æ—è –º–∞—Ç—å –∏–ª–∏ –Ω–∞—á–Ω—ë—à—å –Ω–∞ –Ω–æ—Ä–º–µ —Å–æ—Å–∞—Ç—å',
'–Ω–µ –º–æ–≥—É –ø–µ—Ä–µ–¥–∞—Ç—å —Ç–µ —á—É–≤—Å—Ç–≤–∞ –∫–æ–≥–¥–∞ —Ç–≤–æ—è —Å–ø–∏–¥–æ–∑–Ω–∞—è –º–∞–º–∞—à–∞ –º–Ω–µ —Å–æ—Å—ë—Ç',
'—Ç–≤–æ—è –º–∞–º–∞—à–∞ —â–∞ –º–æ–π —Ö—É–π –∑–∞ —â–µ–∫—É –ø—É—Å—Ç–∏–ª–∞ –∏ –Ω–µ —Ö–æ—á–µ—Ç –≤—ã—Å–æ–≤—ã–≤–∞—Ç—å',
'—Ç–≤–æ—è –º–∞—Ç—å —É–∂–µ –Ω–∞ –º–æ–π —Ö—É–π –ø—Ä—ã–≥–∞–µ—Ç –∫–∞–∫ –Ω–∞ —Ä–∞–±–æ—Ç—É –∏–¥—ë—Ç',
'–∑–∞—á–µ–º —Ç–≤–æ—è –º–∞—Ç—å –æ–ø—è—Ç—å –º–Ω–µ —Å–æ—Å—ë—Ç –º–æ–∂–µ—Ç –æ–Ω–∞ –ø–æ–¥—É–º–∞–ª–∞ —á—Ç–æ –º–æ–∂–µ—Ç –æ—Ç—Å–∞—Å—ã–≤–∞—Ç—å –º–Ω–µ –±–µ–∑–ª–µ–º–∏—Ç–Ω–æ',
'—Ç–≤–æ—è –º–∞—Ç—å —É–ø–∞–ª–∞ –ø–µ—Ä–µ–¥ –º–æ–∏–º —Ö—É—ë–º –∫–æ–≥–¥–∞ –ø–æ–¥—Å—Ç–∞–≤–∏–ª –ø–µ—Ä–¥–∞–∫ –ø–µ—Ä–µ–¥ —Å–≤–æ–∏–º –±–∞—Ç–µ–π –Ω–æ —ç—Ç–æ—Ç –æ—Å—ë–ª –ø–æ–±–æ—è–ª—Å—è –µ–≥–æ –ø–æ–µ–±–∞—Ç—å –≤–µ–¥—å –æ–Ω –∑–Ω–∞–µ—Ç —á—Ç–æ –º–æ—è –∑–∞–ª—É–ø–∞ –æ–ø—è—Ç—å –ø—Ä–æ–±—å—ë—Ç –µ–≥–æ –≥–æ—Ä–±',
'—Ç–≤–æ—è –º–∞–º—É–ª—å–∫–∞ —â–∞ –º–æ–π —Ö—É–π –ø–æ –≥–ª–∞–Ω–¥—ã –ø—É—Å—Ç–∏–ª–∞ —è –ø—Ä–µ–¥–ª–∞–≥–∞—é –¥–∞—Ç—å –µ–π –º–µ–¥–∞–ª—å–∫—É –∑–∞ –≥–æ–¥–æ–≤–æ–π –æ—Ç—Å–æ—Å –±–µ–∑ –ø–µ—Ä–µ—Ä—ã–≤–∞',
'–Ω—É –Ω—É —Å–∫–∞–∂–∏ —á—Ç–æ —Ç–≤–æ—è –º–∞–º–∞—à–∫–∞ –Ω–µ —à–∞–±–æ–ª–¥–∞ —è —Å–≤–æ–∏–º —Ö—É—ë–º —ç—Ç–æ –æ–ø—Ä–æ–≤–µ—Ä–≥–Ω—É',
'—Ä–∞–∑–≤–æ—Ä–æ—à–∏–ª —Ç–≤–æ—é –º–∞–º–∞—à–∫—É —Ö—É—ë–º –∏ –≤—ã–Ω–µ—Å –æ—Ç —Ç—É–¥–∞ –≤—Å—ë —á—Ç–æ –º–æ–∂–Ω–æ',
'—è —Ç–≤–æ—é –¥—É—Ä–Ω—É—é –º–∞–º–∞—à—É —â–∞ –Ω–∞ —Ö—É–µ –∑–∞ —Ç–∞–∫–∏–µ –¥–≤–∏–∂–µ–Ω–∏—è –ø—Ä–æ–≤–µ—Ä–Ω—É',
'–Ω–µ –≤–µ—Ä–∏—à—å –º–Ω–µ —á—Ç–æ —Ç–≤–æ—è –º–∞–º–∞—à–∞ –º–æ–π —Ö—É–π –±–µ–∑–∞—Å—Ç–æ–Ω–æ–≤—á–Ω–æ —Å–æ—Å—ë—Ç —Ç–∞–∫ –ø—Ä–∏—Ö–æ–¥–∏ –æ–Ω–∞ –¥–∞—Å—Ç —Ç–µ —É—Ä–æ–∫–∏ –æ—Ç—Å–æ—Å–∞',
'–Ω–µ –º–æ–≥—É –ø–æ–Ω—è—Ç—å –ø–æ—á–µ–º—É —Ç–≤–æ—è –º–∞–º–∞—à–∞ —Ç–∞–∫–∞—è —Å–ª–∞–±–∞—è —à–ª—é—Ö–∞ —á—Ç–æ –¥–∞–∂–µ –º–æ–π —Ö—É–π —É–∂–µ –æ—Å–∏–ª–∏—Ç—å –Ω–µ –º–æ–∂–µ—Ç',
'—Ç–≤–æ—é –º–∞–º–∞—à—É —â–∞ —Ö—É—ë–º –ø–µ—Ä–µ–≤–µ—Ä–Ω—É —Ö–æ—Ç—è —ç—Ç–æ –∂–∞–ª–∫–∞—è –Ω–∞—á–Ω—ë—Ç –æ–ø—è—Ç—å –≤ –∫–æ–Ω–≤—É–ª—å—Å–∏—è—Ö –±–∏—Ç—å—Å—è',
'–Ω—É —É–∂–µ –±–µ–∑ —à—É—Ç–æ–∫ –≤ —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ —Ä–∞–∑–∞–≥–Ω–∞–ª—Å—è –∞ –æ–Ω–∞ –Ω–∞—á–∏–Ω–∞–µ—Ç –∫–∞–∫ —Å–≤–∏–Ω—å—è –≤–∏–∑–∂–∞—Ç—å',
'—Ç–≤–æ—é –º–∞—Ç—å —Ö—É—ë–º –≤—ã—Å–µ–∫ –∑–∞ —Ç–æ —á—Ç–æ –æ–Ω–∞ —Ç–≤–æ–µ–º—É –±–∞—Ç–∏ –æ—Ç—Å–æ—Å–∞—Ç—å –ø—ã—Ç–∞–ª–∞—Å—å',
'—Ç–≤–æ—è –º–∞—Ç—å –ª–µ–∑–ª–∞ –∫–æ –º–Ω–µ —Ü–µ–ª–æ–≤–∞—Ç—å—Å—è –Ω–æ –µ–π –∑–∞–ª—É–ø–æ–π –ª–æ–± —Ä–∞—Å–∫—Ä–æ—à–∏–ª –ø—É—Å—Ç—å –∑–Ω–∞–µ—Ç —Å–≤–æ—ë –º–µ—Å—Ç–æ',
'–Ω—É –∏ —á—ë —Ç–≤–æ—è –º–∞—Ç—å —É–∂–µ –≥–∏–ª—å–¥–∏—é —Å–æ–∑–¥–∞–ª–∞ —á—Ç–æ–±—ã –º–æ–π —Ö—É–π –≤–æ—Å—Ö–≤–∞–ª—è—Ç—å',
'—Ç–≤–æ—è –º–∞—Ç—å —â–∞ –º–æ–π —Ö—É–π –ø—Ä–∏ –ø–æ–¥—Ä—É–≥–∞—Ö —Ä–∞—Å—Ö–≤–∞–ª–∏–≤–∞–ª–∞ –∏ –æ–Ω–∏ —Ç–æ–∂–µ —Ä–µ—à–∏–ª–∏ –º–Ω–µ –æ—Ç—Å–æ—Å–∞—Ç—å –Ω–æ –ª—É—á—à–µ —Ç–≤–æ–µ–π –º–∞—Ç—É—Ö–µ –Ω–µ –∫—Ç–æ –Ω–µ —Å–æ—Å—ë—Ç',
'–µ—Å–ª–∏ —Ç—ã —Ö–æ—á–µ—à—å –º–æ–π —Ö—É–π —Ç–æ–≥–¥–∞ —Ç–µ –ø—Ä–∏–¥—ë—Ç—å—Å—è –ø–æ–∫–æ–Ω–∫—É—Ä–∏—Ä–æ–≤–∞—Ç—å —Å —Ç–≤–æ–µ–π –º–∞–º–∞—à–µ–π',
'–Ω—É –∏ —á—ë —Ç—ã —â–∞—Å –ø–æ–¥–æ—Ö–Ω–µ—à—å –Ω–∞ –º–æ—ë–º —Ö—É—é —á–µ–º –æ–ø–æ–∑–æ—Ä–∏—à—å —Å–≤–æ—é –º–∞–º–∞—à—É —Ö–æ—Ç—è –º–æ–π —Ö—É–π –∏ —Ç–∞–∫ –µ—ë –æ–ø—É—Å—Ç–∏–ª –µ–∑ –µ–∑',
'—Ç–≤–æ—è –º–∞—Ç—É—à–∫–∞ –º–æ–∂–µ—Ç –æ—Ç—Ä–∏—Ü–∞—Ç—å —á—Ç–æ —Å–æ—Å–∞–ª–∞ –º–Ω–µ –Ω–æ —É –º–µ–Ω—è –µ—Å—Ç—å –ø—Ä—è–º–æ–µ –¥–æ–∫–∞–∑–∞—Ç–µ–ª—å—Å—Ç–≤–æ –≤–µ–¥—å —è –∑–∞–∫–∞—á–∞–ª –µ—ë –∏–∑–Ω—É—Ç—Ä–∏ —Å–ø–µ—Ä–º–æ–π',
'—Ç–≤–æ—è –º–∞—Ç—å –ø—Ä–æ–≤–∏–Ω–∏–ª–∞—Å—å –ø–µ—Ä–µ–¥ –º–æ–∏–º —Ö—É—ë–º –∏ –µ–π –ø—Ä–∏—à–ª–æ—Å—å –∏–∑–≤–µ–Ω—è—Ç—å—Å—è —Å–≤–æ–µ–π –∂–∞–ª–∫–æ–π –≥–ª–æ—Ç–∫–æ–π',
'–Ω—É —Ç—ã —Ä–∏–ª–∏ –Ω–µ –≤–¥—É–ø–ª—è–µ—à—å —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å –º–æ–π —Ö—É–π —Ä–µ—à–∏–ª–∞ –≤ –∞—Ä–µ–Ω–¥—É –≤–∑—è—Ç—å –Ω–∞ –¥–µ–Ω—å –∏–∑ –∑–∞ —á–µ–≥–æ –ø—Ä–æ–¥–∞–ª–∞ –ø–æ—á–∫—É —Ç–≤–æ–µ–≥–æ –±–∞—Ç–∏',
'–Ω—É —á—ë –±—É–¥–µ–º —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞—Ç—å –∏–ª–∏ —Ç—ã –æ–ø—è—Ç—å —Ä–µ—à–∏–ª –º–æ–π —Ö—É–π –Ω–µ —Å –∫–µ–º –Ω–µ –¥–µ–ª–∏—Ç—å',
'—Ö—É—ë–º —Ç–≤–æ—é –º–∞—Ç—å —â–∞ —Ä–∞–∑–º–µ–Ω–∏—Ä–æ–≤–∞–ª –∞ –æ–Ω–∞ –æ—Ç –±–ª–∞–≥–æ–¥–∞—Ä–Ω–æ—Å—Ç–∏ –æ–± –º–æ–π —Ö—É–π —Å–≤–æ—é –ø–∏–∑–¥—É —Å—Ç—ë—Ä–ª–∞ –Ω–∞ –µ–∑ –µ–∑',
'—Ç–≤–æ—é –º–∞—Ç—å —â–∞ —Ö—É—ë–º —Ä–∞—Å—á–µ–ª–µ–Ω–∏–ª –∞ –æ–Ω–∞ –¥–∞–∂–µ –≤ —Ç–∞–∫–æ–º –ø–æ–ª–æ–∂–µ–Ω–∏–∏ —Å–º–æ–≥–ª–∞ –æ—Ç—Å–æ—Å–∞—Ç—å –º–Ω–µ',
'—Ç–≤–æ—è –º–∞—Ç—å –Ω–µ –º–æ–∂–µ—Ç –ø–æ–Ω—è—Ç—å —á—Ç–æ –º–æ–π —Ö—É–π –Ω–µ –≤—Å–µ–≥–¥–∞ –±—É–¥–µ—Ç –¥–µ—Ä–∂–∞—Ç—å –Ω–∞–¥ –Ω–µ–π –≤–ª–∞—Å—Ç—å —Ç–∞–∫ —Ç–æ',
'—Ö—É—ë–º —Ç–≤–æ—é –º–∞—Ç—å –ø–ª–æ–º–±–∏—Ä–æ–≤–∞–ª –µ–π –¥–∞–∂–µ –∫ —Å—Ç–∞–º–∞—Ç–æ–ª–æ–≥—É —Ö–æ–¥–∏—Ç—å',
'—Ç–≤–æ—é –º–∞—Ç—å —Ö—É—ë–º —Ä–∞–∑—Ä–µ–∑–∞–ª –∞ –æ–Ω–∞ –ø–æ–±–µ–∂–∞–ª–∞ –∫ —Ç–≤–æ–µ–º—É –±–∞—Ç–∏ –∏ –ø–æ–∫–∞–∑–∞–ª–∞ –æ—Ç—Ä–µ–∑–∞–Ω—É—é –ø–∏–∑–¥—É –∫–∞–∫ –ø—Ä–∏–∫–æ–ª',
'—Ö—É—ë–º —Ç–≤–æ—é –º–∞—Ç—å –Ω–∞—É—á–∏–ª –ø–∏—Å–∞—Ç—å –Ω–æ –æ–Ω–∞ –ø–ª–æ—Ö–æ –≤–æ—Å–ø—Ä–∏–Ω–∏–º–∞–µ—Ç —É—á–µ–Ω–∏—è –∏ –Ω–∞—á–∏–Ω–∞–µ—Ç —Å–æ—Å–∞—Ç—å –Ω–∞ –∞–≤—Ç–æ–º–∞—Ç–µ',
'—è —Å—Ç—Ä–µ–ª—è–ª –≤ —Ç–≤–æ—é –º–∞—Ç—å —Ö—É—ë–º –≤—ã—Å—Ç—Ä–µ–ª–∏–ª –∏ –æ–Ω–∞ —Ç–≤–∞—Ä—å –æ–∂–∏–ª–∞ –∏ –Ω–∞—á–∞–ª–∞ –ø–æ–ª–∑—Ç–∏ –∫ –º–æ–µ–º—É —Ö—É—é',
'—Ç–≤–æ—è –º–∞—Ç—å —Ä–µ–∫–æ—Ä—Ç—Å–º–µ–Ω–∫–∞ –ø–æ —Å–æ—Å–∞–Ω–∏—é –º–æ–µ–≥–æ —Ö—É—è –µ—ë —Ä–µ–∫–æ—Ä–¥ –¥–∞–∂–µ —Ç–≤–æ–π –±–∞—Ç—è –Ω–µ –º–æ–∂–µ—Ç –ø–æ–±–∏—Ç—å',
'–Ω—É –∏ —á—ë —Ç–≤–æ—è –º–∞—Ç—å –º–Ω–µ —Å–æ—Å–∞–ª–∞ –Ω–µ –Ω–∞–¥–æ –æ—Ç—Ä–∏—Ü–∞—Ç—å –≤–µ–¥—å —Ç—ã —Ç–æ–∂–µ –∑–∞–ø–æ–¥–æ–∑—Ä–µ–Ω –≤ —ç—Ç–æ–º',
'—Ä–∞–∑–∫—É–º–∞—Ä–∏–ª —Ç–≤–æ—é –º–∞—Ç—å —Ö—É—ë–º –¥–∞ —Ç–∞–∫–æ–π —Å—Ç–µ–ø–µ–Ω–∏ —á—Ç–æ –æ–Ω–∞ –µ–ª–∏ –µ–ª–∏ –¥–æ–±—Ä–∞–ª–∞—Å—å –¥–æ –¥–æ–º–∞ –¥–∞–∂–µ –ø–æ –¥–æ—Ä–æ–≥–µ –æ–Ω–∞ —É—Å–ø–µ–ª–∞ –∫–æ–º—É —Ç–æ –æ—Ç—Å–æ—Å–∞—Ç—å —à–∞–ª–∞–≤–∞ –∂–∞–ª–∫–∞—è',
'–Ω—É –∏ —á—ë —Ç—ã –º–æ–∂–µ—à—å —è –∂–µ —Å–≤–æ–∏–º —Ö—É—ë–º —Ç–≤–æ–∏ –º—ã—Å–ª–∏ —Ç–∞–∫ —Ç–æ –ø–µ—Ä–µ—Å—Ç—Ä–æ–∏–ª –¥—É—Ä–µ–Ω—å',
'–Ω–µ –º–æ–≥—É —Å–∫–∞–∑–∞—Ç—å —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å —Å–æ—Å—ë—Ç –≤—Å–µ–º –æ—á–µ–Ω—å —á–∞—Å—Ç–æ –≤–µ–¥—å –≤–æ–∑–ª–µ —Å–≤–æ–µ–≥–æ —Ö—É—è —è –≤–∏–∂—É –µ—ë –∫–∞–∂–¥—ã–π –¥–µ–Ω—å',
'–Ω—É —Ç–≤–æ—è –º–∞—Ç—å —É–∂–µ –ø–æ –±–ª–∞—Ç—É –º–Ω–µ —Å–æ—Å—ë—Ç –Ω–æ –µ–π –Ω–µ —Ö–≤–∞—Ç–∞–µ—Ç —Å—Ç–∏–º—É–ª–∞ –º–æ–∂–µ—Ç —Ç–≤–æ–µ–º—É –±–∞—Ç–∏ —Ö—É—ë–º –≤–µ–Ω—ã –≤—Å–∫—Ä—ã—Ç—å',
'—Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ —Å–≤–æ–π —Ö—É–π –≤ —Ä–∞–º–∫—É –ø–æ—Å—Ç–∞–≤–∏–ª –∏ —Ç–µ–ø–µ—Ä—å –≤—ã –≤—Å–µ–π —Å–µ–º—å—ë–π –∏–º –ª—é–±—É–µ—Ç–µ—Å—å',
'–ø–æ –ø—Ä–∏–∫–æ–ª—É —Ç–≤–æ—é –º–∞—Ç—å —Ö—É—ë–º –Ω–∞ –ª—É–Ω—É –∑–∞–∫–∏–Ω—É–ª –∞ –æ–Ω–∞ –¥–∞–∂–µ —Ç–∞–º –≤ –ø–µ—Ä–¥–∞—á–µ–ª–æ –∫–æ–º—É —Ç–æ –¥–∞–ª–∞ –æ—Ä–Ω–∏ —Å —ç—Ç–æ–π —à–ª—é—Ö–∏',
'–º–æ–≥—É —Ç–≤–æ—é –º–∞–º–∞—à—É —Ö—É—ë–º –≤–∑—è—Ç—å –Ω–∞ –ø—Ä–æ–≥–∏–± –Ω–æ –Ω–µ —Ö–æ—á—É –≤–µ–¥—å –æ–Ω–∞ —Å—Ç–æ–∏—Ç —Ä–∞–∫–æ–º –∏ –∂–¥—ë—Ç –∫–æ–≥–¥–∞ —è –µ—ë –≤—ã–µ–±—É',
'—Ä–∞—Å—à–∏—Ä–∏–ª –≥–ª–∞–Ω–¥—ã —Ö—É—ë–º —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –∑–∞—Ç–æ —Ç–µ–ø–µ—Ä—å –æ–Ω–∞ –±–æ–ª—å—à–µ –º–æ–∂–µ—Ç –æ–ø—Ä–∞–±–∞—Ç—ã–≤–∞—Ç—å –º–æ–π —á–ª–µ–Ω —Å–≤–æ–∏–º —Ä—Ç–æ–º',
'–Ω–µ —Å–∏–ª—å–Ω–æ –≤—å–µ–±–∞–ª —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –∑–∞–ª—É–ø–æ–π –Ω–æ –æ–Ω–∞ –æ—Ç–∫–ª—é—á–∏–ª–∞—Å—å —â–∞ –ø—Ä–æ—Å–Ω—ë—Ç—å—Å—è –ø–æ –Ω–æ–≤–æ–π –µ—ë –ø–æ–µ–±—É',
'–Ω–∞ –Ω–µ–≥–∞—Ç–∏–≤–µ –µ–±–∞–ª –º–∞—Ç—å —Ç–≤–æ—é –≤–µ–¥—å –æ–Ω–∞ –∑–∞–µ–±–∞–ª–∞ –≤—ã—Ä—ã–≤–∞—Ç—å—Å—è –∑–∞ —á—Ç–æ —è –µ–π —É–µ–±–∞–ª –ª–µ—â–∞',
'—Ä–∞–∑–æ—Ä–≤–∞–ª —Ç–≤–æ—é –º–∞—Ç—å —Ö—É—ë–º –Ω–∞ —á–∞—Å—Ç–∏ —Ç–µ—Ä—å —Ç—ã –µ–¥–∏–Ω—Å—Ç–≤–µ–Ω—ã–π –∫—Ç–æ –±—É–¥–µ—Ç –º–æ–π —Ö—É–π –¥–æ —É–±–æ—è —Å–æ—Å–∞—Ç—å',
'—Ä–∞—Å—Ç—Ä–æ–≥–∞–ª —Ç–≤–æ—é –º–∞—Ç—å –∫–æ–≥–¥–∞ —Ö—É—ë–º –≤—å–µ–±–∞–ª –µ–π –ø–æ –≥—É–±–∞–º –≤–µ–¥—å –∫–∞–∫ –º—ã –ø–æ–º–Ω–∏–º —è —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ —Ä–∞–Ω—å—à–µ —Ä–∞–∑–∏–±–≤–∞–ª –∞ —â–∞—Å –ø—Ä–æ—Å—Ç–æ —Ä–∞—Å—ë–∫ –æ–Ω–∞ —Ä–∞–¥–∞',
'—Ç–≤–æ—è –º–∞—Ç—å –ø–æ—Å—Ç—Ä–æ–∏–ª –æ–±–æ—Ä–æ–Ω—É –æ—Ç –º–æ–µ–≥–æ —Ö—É—è –Ω–æ —Å –∫–∞–∂–¥—ã–º —É–¥–∞—Ä–æ–º –ø–æ —Å—Ç–µ–Ω–∞–º —ç—Ç–æ–π –æ–±–æ—Ä–æ–Ω—ã —è –≤—Å—ë –±–ª–∏–∂–µ –∫ –≥–ª–æ—Ç–∫–µ —Ç–≤–æ–µ–π –º–∞—Ç—É—Ö–µ',
'–º–æ–π —Ö—É–π —É–∂–µ –Ω–∞ —Å—Ç–æ–ª—å–∫–æ –≤—ã—Ä–æ—Å –≤ –≥–ª–∞–∑–∞—Ö —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ —á—Ç–æ –æ–Ω–∞ —Å–æ—Å—ë—Ç –µ–≥–æ –º–µ—Å—Ç–æ –∑–∞–≤—Ç—Ä–∞–∫–∞',
'—Ä–∞–∑–º—É—Ä–æ–≤–∞–ª —Ç–≤–æ—é –º–∞—Ç—å —Ö—É—ë–º –∫–æ–≥–¥–∞ –æ–Ω–∞ –Ω–µ –º–æ–≥–ª–∞ –≤—ã–±—Ä–∞—Ç—å—Å—è –∏–∑ –∑–∞ —á–µ–≥–æ —Ç–µ–ø–µ—Ä—å –æ–Ω–∞ –ø–æ –∂–∏–∑–Ω–µ–Ω–æ –º–Ω–µ –¥–æ–ª–∂–Ω–∞ –æ—Ç—Å–∞—Å—ã–≤–∞—Ç—å –∞ –ø–æ—Ç–æ–º —Ç—ã –µ—ë —Å–º–µ–Ω–∏—à—å –ø—Ä–∞–≤–¥–∞ –∂–µ',
'–Ω–∞–∫–∏–Ω—É–ª —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –≤ –∫–∞–±–∏–Ω—É –∑–∞ —Ç–æ —á—Ç–æ –æ–Ω–∞ —Ä–µ—à–∏–ª–∞ –æ—Å–∏–ª–∏—Ç—å –º–æ–π —Ö—É–π —Å–≤–æ–∏–º —Ä—Ç–æ–º –ø—É—Å—Ç—å —Ç–∞–∫–∞—è —à–∞–≤–∫–∞ –¥–∞–∂–µ –Ω–µ –ø–∏—Ç–∞–µ—Ç –Ω–∞–¥–µ–∂–¥—ã',
'–Ω–∞–≥–æ—Ä–Ω—É–ª —Ç–≤–æ—é –º–∞—Ç—å —Ö—É—ë–º –ø—Ä–æ—Å—Ç–æ –ø–æ –ø—Ä–∏–Ω—Ü–∏–ø—É –Ω–æ –æ–Ω–∞ –¥–∞–∂–µ —Ç–∞–∫ —Ä–µ—à–∏–ª–∞ –¥–∞—Ç—å –º–Ω–µ –≤ –ø–∏–∑–¥—É –∫–∞–∫ –±—ã–ª–∞ —à–ª—é—Ö–æ–π —Ç–∞–∫ –∏ –æ—Å—Ç–∞–ª–∞—Å—å',
'–º—ã –ø–æ—Å–ø–æ—Ä–∏–ª–∏ —Å –æ—Ç—Ü–æ–º —á—Ç–æ —Ç–≤–æ—è –º–∞–º–∞—à–∞ —Å–æ—Å–∞–ª–∞ –º–Ω–µ –Ω–µ –±–æ–ª—å—à–µ 200 —Ä–∞–∑ –≤ –¥–µ–Ω—å –Ω–æ –æ–Ω –ø—Ä–æ–∏–≥—Ä–∞–ª –≤–µ–¥—å —É–≤–∏–¥–µ–ª –∫–∞–∫ –æ–Ω–∞ –æ—Ç—Å–∞—Å—ã–≤–∞–µ—Ç –º–Ω–µ –≤ –∂–∏–≤—É—é',
'—Ç–≤–æ—é –º–∞—Ç—å –ø–µ—Ä–≤—ã–π —Ä–∞–∑ –∑–∞ –∫—É—Å–æ–∫ —Å–∞–ª–æ –≤—ã–µ–±–∞–ª –∞ –æ–Ω–∞ —Ä–∞–¥–æ–≤–∞–ª–∞—Å—å —á—Ç–æ –º–æ–∂–µ—Ç –Ω–∞–∫–æ—Ä–º–∏—Ç—å —Ç–µ–±—è –Ω–æ –∫–∞–∫ –ø–æ–µ–ª —Å–ª–∏–∑–µ–Ω—å',
'–ø–æ–ø—Ä–æ–±—É–π –µ—â—ë —Ä–∞—Å —Å–∫–∞–∑–∞—Ç—å —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å –ø–µ—Ä–µ–≤–µ–¥–∞–ª–∞ —Å—Ç–æ–ª—å–∫–æ –∫–ª—ë–≤—ã—Ö —Ö—É—ë–≤ —è —Ç–µ–±—è —É–µ–±—É —Ö—É—ë–º –≤–µ–¥—å –æ–Ω–∞ –Ω–∞ –æ—Ç—Å–æ—Å–µ –ø—Ä–∏–∑–Ω–∞–≤–∞–ª—Å—å —á—Ç–æ –º–æ–π —Ö—É–π —Å–∞–º—ã–π –ª—É—á—à–∏–π',
'–ø–æ –∑–≤–µ—Ä—Å–∫–∏ —Ç–≤–æ—é –º–∞—Ç—å –µ–±—É –æ–Ω–∞ –≤ —à–æ–∫–µ –∏ –¥—É–º–∞–µ—Ç —á—Ç–æ —ç—Ç–æ –ª—é–±–æ–≤—å –Ω–æ —è –ø—ã—Ç–∞—é—Å—å –≤–∫–∞—á–∞—Ç—å –µ—ë —Å–ø–µ—Ä–º–∞–∫–æ–º —á—Ç–æ–±—ã –æ–Ω–∞ –ø–µ—Ä–µ–¥–æ–∑–Ω—É–ª–∞—Å—å',
'–Ω—É –∏ —á—ë –º—ã —Ç–µ–ø–µ—Ä—å —Å —Ç–≤–æ–∏–º –±–∞—Ç–µ–π –¥—Ä—É–∑—å—è –ø–æ—Å–ª–µ —Ç–æ–≥–æ –∫–∞–∫ —è –¥–∞–ª —Ç–≤–æ–µ–π –º–∞–º–∞—à–∫–µ –Ω–∞ –∫–ª—ã–∫ –æ–Ω —É–∑–Ω–∞–ª —á—Ç–æ –æ–Ω–∞ –∂–∞–ª–∫–∞—è —à–ª—é—Ö–∞ –∏ —Å–¥–∞–ª –µ—ë –º–Ω–µ –≤ —Ä–∞–±—Å—Ç–≤–æ',
'—Ç–≤–æ—è –º–∞—Ç—å —Å–Ω–∞—á–∞–ª–∞ –¥—É–º–∞–ª–∞ —á—Ç–æ –º–æ–π —Ö—É–π –Ω–µ –≤—ã–∑—ã–≤–∞–µ—Ç –∑–∞–≤–∏—Å–∏—Å–º–æ—Å—Ç –Ω–æ —Å –∫–∞–∂–¥—ã–º —Ä–∞–∑–æ–º —Å–æ—Å–∞–ª–∞ –≤—Å—ë –±–æ–ª—å—à–µ –∏ –±–æ–ª—å—à–µ',
'–Ω–∞ —Ä–∞–∑–æ–≥—Ä–µ–≤ —Ç–≤–æ—é –º–∞–º–∞—à—É –ø–æ–µ–±–∞–ª –∞ –ø–æ—Ç–æ–º —Ç–≤–æ–π –±–∞—Ç—è —Ä–µ—à–∏–ª –º–Ω–µ –ø–æ —Ñ–∞–Ω—É –æ—Ç—Å–æ—Å–∞—Ç—å —è —Ç–µ–ø–µ—Ä—å –¥—É–º–∞—é —É –≤–∞—Å –≤—Ä–æ–∂–¥—ë–Ω–æ–µ –º–æ–π —Ö—É–π —Å–æ—Å–∞—Ç—å',
'–º–æ–π —Ö—É–π –ø—Ä–æ—à—ë–ª—Å—è –ø–æ —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –æ—Ç –Ω–∞—á–∞–ª–∞ –∏ –¥–æ –∫–æ–Ω—Ü–∞ –∏ —Ç—ã –¥–æ–ª–∂–µ–Ω –±—ã—Ç—å –±–ª–∞–≥–æ–¥–∞—Ä–µ–Ω—å —á—Ç–æ –º–æ–π —Ö—É–π –æ—Å—Ç–∞–≤–∏–ª –µ—ë –æ–±–ª–∏—Ç–æ–π —Å–ø–µ—Ä–º–∞–∫–æ–º –∞ –Ω–µ —Ä–∞–∑–º–∞—Ç–∞–ª',
'—Ä–∞–∑–∫—Ä–µ–ø–æ—Å—Ç–∏–ª —Ç–≤–æ—é –º–∞—Ç—å —Ö—É—ë–º –∏ —Ç–µ–ø–µ—Ä—å –æ–Ω–∞ –Ω–µ —Ç–∞–∫ —Å–∏–ª—å–Ω–æ –±–æ–∏—Ç—å—Å—è —Å–æ—Å–∞—Ç—å –º–æ–π —Ö—É–π –Ω–∞ –≥–ª–∞–∑ —É —Ç–≤–æ–µ–≥–æ —É—â–µ—Ä–±–Ω–æ–≥–æ –æ—Ç—Ü–∞',
'–Ω–∞ –∫–∞–Ω—É–Ω–µ —Ç–≤–æ—é –º–∞—Ç—å –ø–æ–µ–±–∞–ª –∏ –º–æ–≥—É —Å–∫–∞–∑–∞—Ç—å –æ–¥–Ω–æ –æ–Ω–∞ –±—ã–ª–∞ –Ω–∞—Å—Ç–æ–ª—å–∫–æ —Ä–∞–∑–≤—Ä–∞—Ç–Ω–æ–π —à–ª—é—Ö–æ–π —á—Ç–æ —Å–æ—Å–∞–ª–∞ –º–Ω–µ —Ö—É–π –¥–∞–∂–µ –Ω–∞ –ª–∞–Ω—á–µ',
'–º–æ–∂–µ—Ç —Ç–≤–æ—è –º–∞—Ç—å –¥–ª—è —Ç–µ–±—è –∏ –ª—É—á—à–∞—è –Ω–æ –º—ã –±—É–¥–µ–º –∑–Ω–∞—Ç—å –≤—Å–µ–≥–¥–∞ —á—Ç–æ —Å –º–æ–µ–≥–æ —Ö—É—è –æ–Ω–∞ –≤—ã—É—á–∏–ª–∞—Å—å –∫–∞–∑–∞—Ç—å –æ–±—Ä–∞–∑–æ–≤–∞–Ω–Ω–æ–π',
'–Ω—É —â–∞—Å —è –Ω–∞—á–Ω—É –∫—Ä—É—Ç–∏—Ç—å —Ç–≤–æ—é –º–∞–º–∞—à—É –Ω–∞ —Ö—É–µ –±–µ–∑ –æ—Å—Ç–∞–Ω–æ–≤–∫–∏ –∞ —Ç—ã –ø–æ—Ä–æ–±—É–π –æ—Å—Ç–∞–Ω–æ–≤–∏—Ç—å —ç—Ç—É –∫–∞—Ä—É—Å–µ–ª—å –∂–∞–ª–∫–∏–π —Ç–æ–ª—å–∫–æ —Å–º–æ—Ç—Ä–∏ —Å–∞–º –Ω–µ –ø–æ–ø–∞–¥–∏ –Ω–∞ –Ω–µ—ë',
'—É —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –µ—Å—Ç—å –∫–æ—Ä–æ–Ω–∫–∞ –∫–æ–≥–¥–∞ —Å–æ–±–∏—Ä–∞—é—Ç—å—Å—è —Ä–æ–¥—Å—Ç–≤–µ–Ω–∏–∫–∏ –∏ –ø—Ä–æ—Å—è—Ç –ø–æ–∫–∞–∑–∞—Ç—å —á–µ–≥–æ –æ–Ω–∞ –¥–æ—Å—Ç–∏–≥–ª–∞ –æ–Ω–∞ –∑–æ–≤—ë—Ç –º–µ–Ω—è –∏ —Å–æ—Å—ë—Ç –º–æ–π —Ö—É–π –∏ –≤—Å–µ –∞–ø–ª–∞–¥–∏—Ä—É—é—Ç –ø—Ä–∏–∫–∏–Ω—å',
'–Ω–∞ –ø–µ—Ä–µ–≤–∞–ª–µ —Ç–≤–æ—é –º–∞—Ç—å –ø–æ–µ–±–∞–ª –æ–Ω–∞ –¥—É–º–∞–ª–∞ —á—Ç–æ –ø—Ä–æ—Å—Ç–æ –æ—Ç–¥–æ—Ö–Ω—ë—Ç –Ω–æ –º–æ–π —Ö—É–π –¥–∞–∂–µ –Ω–µ –æ—Å—Ç–∞–≤–∏–ª –µ–π —à–∞–Ω—Å–æ–≤ –Ω–∞ –≤—ã–∂–∏–≤–∞–Ω–∏—è –∑–∞—Ç–æ —Ç–µ–ø–µ—Ä—å –æ–Ω–∞ –≥—Ä–∞–Ω—Ç –º–∞—Å—Ç–µ—Ä –ø–æ —Å–æ—Å–∞–Ω–∏—é –º–æ–µ–≥–æ —Ö—É—è',
'—Ç–≤–æ—è –º–∞—Ç—É—à–∫–∞ –Ω–µ —Ç–∞–∫ —á–∞—Å—Ç–æ —Å—Ç–∞–ª–æ —Å–æ—Å–∞—Ç—å –º–Ω–µ —Ö—É–π —è —Ä–µ—à–∏–ª —Ä–∞–∑–æ–±—Ä–∞—Ç—å—Å—è –≤ —á—ë–º –¥–µ–ª–æ –æ–∫–∞–∑—ã–≤–∞–µ—Ç—å—Å—è —Ç–≤–æ–π –±–∞—Ç—è –ø–æ–ø—Ä–æ—Å–∏–ª —á—Ç–æ–± –æ–Ω–∞ —Å–æ—Å–∞–ª–∞ –º–Ω–µ —Ä–µ–∂–µ —è –∫–∞–∫ —É–µ–±–∞–ª –µ–≥–æ —Ö—É—ë–º –ø–æ—Å–ª–µ —á–µ–≥–æ –æ–Ω –ø–µ—Ä–µ–¥—É–º–∞–ª',
'—è —Ö–æ—á—É —á—Ç–æ–±—ã —Ç–≤–æ—è –º–∞—Ç—å —Å–æ—Å–∞–ª–∞ –º–Ω–µ –¥–æ –∫–æ–Ω—Ü–∞ –≤–µ–∫–∞ –Ω–æ —è –ø–æ–Ω–∏–º–∞—é —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å –Ω–µ –≤–µ—á–Ω–æ –Ω–æ –º–æ–π —Ö—É–π –æ–±—Ä—ë–ª —Å–ø–æ—Å–æ–±–Ω–æ—Å—Ç—å —Ä–µ–Ω–∫–∞—Ä–Ω–∞—Ü–∏–∏ —Ç–µ–ø–µ—Ä—å —Ç–≤–æ—è –º–∞—Ç—å –≤ –±–µ–∑–Ω–∞–¥—ë–∂–Ω–æ–º –ø–æ–ª–æ–∂–µ–Ω–∏–∏',
'–Ω–∞ —Ä—ã–Ω–∫–µ —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –∑–∞ –ø—Ä–∏–ª–∞–≤–∫–æ–º –∞ –∑–Ω–∞–µ—à—å –∫–∞–∫ –≤—Å—ë –Ω–∞—á–∞–ª–æ—Å—å –æ–Ω–∞ —Ä–µ—à–∏–ª–∞ –ø—Ä–æ–¥–∞—Ç—å –º–Ω–µ –æ–≥—É—Ä—Ü—ã –∫–æ—Ç–æ—Ä—ã–µ —Å–æ–≤–∞–ª–∞ –≤ —Å–≤–æ—é —Å–ø–∏–¥–æ–∑–Ω—É—é –ø—Ä–æ—â–µ–ª–∏–Ω—É –ø—Ä–∏–¥—ë—Ç—å—Å—è –µ—â—ë –æ—Ç—Ö—É—è—Ä–∏—Ç—å –µ—ë',
'–Ω–∞ –≤–æ–∑–≤—ã—à–µ–Ω–∏–∏ —Ç–≤–æ—é –º–∞—Ç—å –ø–æ–µ–±–∞–ª –æ–Ω–∞ —Ä–µ—à–∏–ª–∞ –ø–æ–ª—é–±–æ–≤–∞—Ç—å—Å—è –≤–∏–¥–∞–º –ø—Ä–∏—Ä–æ–¥—ã –Ω–æ –º–æ–π –±—ã–ª –Ω–∞—Å—Ç–æ–ª—å–∫–æ —Ä–µ–∑–≤—ã–π —á—Ç–æ –µ–π –ø—Ä–∏—à–ª–æ—Å—å –ª—é–±–æ–≤–∞—Ç—å—Å—è –≤–∏–¥–æ–º –º–æ–µ–≥–æ —Ö—É—è',
'–Ω–∞ —Ä—ã–±–∞–ª–∫–µ —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –ø–æ–∫–∞ —Ç–≤–æ–π –±–∞—Ç—è –Ω–∞—Å–∞–∂–∏–≤–∞–ª —á–µ—Ä–≤—è–∫–æ–≤ –Ω–∞ —É–¥–æ—á–∫—É –∏ –ø—ã—Ç–∞–ª—Å—è –ø–æ–π–º–∞—Ç—å —Ä—ã–±—É —è —É–∂–µ –≤–æ –≤—Å—é –¥–æ–±–∏–≤–∞–ª —Å–≤–æ–∏–º —Ö—É—ë–º —Ç–≤–æ—é —à–∞–∫–∞–ª—å–Ω—É—é –º–∞—Ç—å',
'–±–µ–∑ –≤—ã—Ö–æ–¥–Ω—ã—Ö —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –ø–æ–∫–∞ –Ω–µ –ø–æ–Ω—è–ª —á—Ç–æ –Ω–∞–¥–æ —á—Ç–æ —Ç–æ –º–µ–Ω—è—Ç—å –ø–æ–∑–≤–∞–ª —Ç–≤–æ–µ–≥–æ –±–∞—Ç—é –∏ –º—ã –≤–º–µ—Å—Ç–µ —Å –Ω–∏–º —Ä–µ—à–∏–ª–∏ –≤—ã–µ–±–∞—Ç—å —Ç—è –ø–æ–º–Ω–∏—à—å –Ω–æ—Ä–º —Ç–æ–≥–¥–∞ –ø–æ–ª—É—á–∏–ª–æ—Å—å',
'–Ω–µ –∫–∏–¥–∞–π—Å—è —Ç–∞–∫ –Ω–∞ –º–æ–π —Ö—É–π –≤–µ–¥—å —Ç—ã –ø–æ–Ω–∏–º–∞–µ—à—å —á—Ç–æ –Ω–µ –≤—ã–≤–µ–∑–∏—à—å –µ–≥–æ –ª—É—á—à–µ –ø–æ–∑–æ–≤–∏ —Å–≤–æ—é –º–∞—Ç—å —É –Ω–µ—ë –∏ —Ç–æ –±–æ–ª—å—à–µ —à–∞–Ω—Å–æ–≤ –µ–≥–æ –æ–¥–∞–ª–µ—Ç—å —á–µ–º —É —Ç–µ–±—è –∂–∞–ª–∫–∞—è –º–æ–Ω–∞—à–∫–∞',
'–¥–∞–∂–µ –Ω–∞–∫—É—Ä–µ–Ω—ã–º —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –æ–Ω–∞ –¥—É–º–∞–ª–∞ —á—Ç–æ —è –ø—Ä–æ—Å—Ç–æ —Ä–∞–¥ –µ—ë –≤–∏–¥–µ—Ç—å –Ω–æ –∫–æ–≥–¥–∞ –º–µ–Ω—è –∫—Ä—ã–ª–æ —è –ø—Ä–µ–¥—Å—Ç–∞–≤–ª—è–ª —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å –Ω–µ —Å–ø–∏–¥–æ–∑–Ω–∞—è –∏ –º–Ω–µ —Å—Ç–∞–Ω–æ–≤–∏–ª–∞—Å—å –ª–µ–≥—á–µ',
'—Ç–≤–æ—è –º–∞—Ç—å —Ä–µ—à–∏–ª–∞ –∑–∞—Å–Ω—è—Ç—å –∫–∞–∫ —è –µ—ë –µ–±—É –ø–æ—Ç–æ–º —Å–∫–∏–Ω—É–ª–∞ –¥—Ä—É–∑—å—è–º –æ–Ω–∏ —Å–º–æ—Ç—Ä–µ–ª–∏ –≤—Å–µ –≤–∏–¥–æ—Å—ã –∏ –ø–æ—Ç–æ–º —Ä–µ—à–∏–ª–∏ —á—Ç–æ –º–æ–π —Ö—É–π –Ω–∞–¥–æ –ø–∏–∞—Ä–∏—Ç—å –≤ —Ç–≤–æ–µ–π –≥–ª–æ—Ç–∫–µ –µ–∑ –µ–∑',
'–∫–æ–≥–¥–∞ —è —É–º–∏—Ä–∞–ª –Ω–∞ –¥–≤–∏–∂–µ —Ç–≤–æ—è –º–∞—Ç—å —Å–¥–µ–ª–∞–ª–∞ –º–Ω–µ –≥–æ—Ä–ª–æ–≤–æ–π –º–∏–Ω—å–µ—Ç –∏ –º–Ω–µ —Å—Ç–∞–ª–æ —Ç–∞–∫ –ª–µ–≥—á–µ —á—Ç–æ —è –Ω–∞—á–∞–ª –≤–æ–∑—Ä–æ–∂–¥–∞—Ç—å—Å—è –æ—Å–º–æ—Ç—Ä–µ–ª—Å—è –≤–æ–∫—Ä—É–≥ –∞ –æ–∫–∞–∑–∞–ª—Å—è –Ω–∞ —Ä–µ–π–≤–µ',
'–≤–∫–∞—á–∞–ª —Ç–≤–æ–µ–≥–æ –æ—Ç—Ü–∞ —Ö—É—ë–º –∏ –º–æ–≥—É –¥–∞–∂–µ —Å —á–∏—Å—Ç–æ–π —Å–æ–≤–µ—Å—Ç—å—é —Å–∫–∞–∑–∞—Ç—å —á—Ç–æ —Ç–≤–æ–π –æ—Ç–µ—Ü –∫–∞–∫ –º–æ–≥ –ø—ã—Ç–∞–ª—Å—è –º–Ω–µ –æ—Ç—Å–æ—Å–∞—Ç—å –Ω–æ –æ–Ω –ø–æ–ª—É—á–∏–ª –º–Ω–æ–≥–æ—á–∏—Å–ª–µ–Ω–Ω—ã–π —É—Ä–æ–Ω –æ—Ç –º–æ–µ–≥–æ —Ö—É—è',
'–∫–æ–≥–¥–∞ —è —Å–µ–ª –≤ —Ç—é—Ä—å–º—É —Ç–≤–æ—è –º–∞—Ç—å –±–µ–≥–∞–ª–∞ –∫–æ –º–Ω–µ –Ω–∞ –∫–∏—á—É –∏ –æ—Ç—Å–∞—Å—ã–≤–∞–ª–∞ –∫–∞–∫ –±–µ—à–µ–Ω–∞—è —è –Ω–∞—á–∞–ª –∫–æ—Ä–º–∏—Ç—å –µ—ë –ª–µ—â–∞–º–∏ –ø–æ—Ç–æ–º—É —á—Ç–æ –∫–∞–∫ –æ–Ω–∞ –≤–æ–±—â–µ –∑–∞–±—Ä–∞–ª–∞—Å—å –≤ –∫–∞–º–µ—Ä—É',
'–Ω–µ –∫–æ–≥–¥–∞ –Ω–µ –ø–æ–π–º—É –æ–¥–Ω–æ–≥–æ –∑–∞—á–µ–º —Ç–≤–æ—è –º–∞—Ç—å —Ç–∞–∫ –æ–±–∏–ª—å–Ω–æ —Å–æ—Å—ë—Ç –∏ –∫ —á–µ–º—É –æ–Ω–∞ —Å—Ç—Ä–µ–º–∏—Ç—å—Å—è –º–æ–∂–µ—Ç —É –Ω–µ—ë –µ—Å—Ç—å –∫–æ–Ω–µ—á–Ω–∞—è —Ü–µ–ª—å –∏ —è –∑–Ω–∞—é –∫–∞–∫–∞—è –±—ã—Ç—å —Å–∞–º–æ–π –≤–µ—Ä–Ω–æ–π –º–æ–µ–≥–æ —Ö—É—é',
'—Ä–∞—Å–∫–æ—Ä–º–∏–ª —Ç–≤–æ—é –º–∞—Ç—å —Ö—É—ë–º —á—Ç–æ –æ–Ω–∞ —Ç–µ–ø–µ—Ä—å —è–≤–ª—è—Ç—å—Å—è –º–µ—Å—Ç–Ω—ã–º –±–æ—Å—Å–æ–º –∏ –µ–¥–∏–Ω—Å—Ç–≤–µ–Ω—ã–º –∫—Ç–æ –µ—ë –º–æ–∂–µ—Ç –∫—Ä—ã—à–æ–≤–∞—Ç—å –µ—ë –Ω–∞ –¥–∞–Ω–Ω—ã–π –º–æ–º–µ–Ω—Ç —ç—Ç–æ –º–π —Ö—É–π –≤–µ–¥—å –æ–Ω–∞ –≤—Å–µ–≥–¥–∞ —Å—Ç–∞–≤–∏–ª –∑–∞ –Ω–µ–≥–æ —Å–≤–µ—á–∫–∏',
'–Ω–µ –∫–æ–º—É –Ω–µ —Å–∫–∞–∂—É —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å —É–∂–µ –Ω–∞—è—Ä–∏–≤–∞–µ—Ç –º–æ–π —Ö—É–π –ø–æ 100 —Ä–∞–∑—É –≤–µ–¥—å –æ–Ω–∞ —ç—Ç–æ –¥–µ–ª–∞–µ—Ç —Å —á–∏—Å—Ç–æ–π —Å–æ–≤–µ—Å—Ç—å—é –∏ –¥—É–º–∞–µ—Ç —á—Ç–æ –µ—Å–ª–∏ —Å–æ—Å–∞—Ç—å –º–æ–π —Ö—É–π —Ç–∞–∫ —á–∞—Å—Ç–æ –æ–Ω–∞ –ø–æ–ø–∞–¥—ë—Ç –≤ —Ä–∞–π',
'—Ç–≤–æ—è –º–∞—Ç—å —Ç–∞–∫–∞—è –±–µ—Å–ø–æ–Ω—Ç–æ–≤–∞—è —á—Ç–æ –ø—Ä–µ–∂–¥–µ —á–µ–º –µ—ë –≤—ã–µ–±–∞—Ç—å —è –¥–∞—é –Ω–∞ —Ä–æ—Ç–∞–Ω —Ç–≤–æ–µ–º—É –æ—Ç—Ü—É –≤–µ–¥—å —Ç–∞–∫ –º–æ–π —Ö—É–π —É–∂–µ –≥–æ—Ç–æ–≤ –∫ —Å—Ç—Ä—ë–º–Ω–æ–π –≥–ª–æ—Ç–∫–µ —Ç–≤–æ–µ–π –µ–±—É—á–µ–π –º–∞—Ç—É—Ö–µ',
'—Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –ø–æ–º–∏–Ω–∫–∏ —Å–≤–æ–∏–º —Ö—É—ë–º –æ—Ä–≥–∞–Ω–∏–∑–æ–≤–∞–ª –∏ –≤—Å–µ —Ä–æ–¥—Å—Ç–≤–µ–Ω–∏–∫–∏ –±—ã–ª–∏ —Ä–∞–¥—ã –≤–µ–¥—å –º–æ–π —Ö—É–π —ç—Ç–æ —Å–∞–º—ã–π –ø–æ—á—ë—Ç–Ω—ã–π –≥–æ—Å—Ç—å –Ω–∞ –∏—Ö –ø–æ–º–∏–Ω–∫–∞—Ö –µ–∑ –µ–∑',
'–ø–æ—Å–ª–µ —Ç–æ–≥–æ –∫–∞–∫ —Ç–≤–æ—è –º–∞—Ç—å —Ä–µ—à–∏–ª–∞ –∑–∞—Ä–µ–π–¥–∏—Ç—å –º–æ–π —Ö—É–π —è –æ—Ç–±–∏–ª –µ—ë —Ä–µ–π–¥ –Ω–æ —Ä–µ—à–∏–ª –Ω–∞–∫–∞–∑—Ç—å –∑–∞ —Å—Ç–æ–ª—å –Ω–∏–∑–∫–æ–µ –¥–∏—è–Ω–∏—è —Ç–µ–ø–µ—Ä—å –æ–Ω–∞ –ª–∏–∂–µ—Ç –º–æ–µ–º—É –∫–µ–Ω—Ç—É –ø—è—Ç–∫–∏ –æ—Ä—É',
'–Ω–∞ –ø–∞–ª—É–±–µ —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –Ω–µ –æ–¥–∏–Ω –º–æ—Ä—è–∫ –∞ –≤—Å—ë –ø–æ—Ç–æ–º—É —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å –Ω–µ –º–æ–∂–µ—Ç –∂–∏—Ç—å –±–µ–∑ —á—É–∂–∏–≤ —Ö—É—ë–≤ –∏ –¥–∞–∂ –±—É–¥—É—á–∏ –≤ –∑–∞–ø–µ—Ä—Ç–∏ –æ–Ω–∞ –Ω–∞–π–¥—ë—Ç –∫–∞–∫–æ–π –Ω–∏–±—É–¥—å —Ö—É–π',
'–Ω–µ –º–æ–≥—É –ø–æ–≤–µ—Ä–∏—Ç—å —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å —Ç–∞–∫ –ø—Ä–æ—Å—Ç–æ –ø–æ–¥—Ç–∞–ª–∞—Å—å –Ω–∞ –ø—Ä–æ–≤–æ–∫–∞—Ü–∏—é –∫–∏–Ω—É—Ç—É—é –º–æ–∏–º —Ö—É—ë–º —á—Ç–æ —Ç–µ–ø–µ—Ä—å –¥–µ–ª–∞—Ç—å –¥–∞–≤–∞–π –ø–æ –Ω–∞–∫–∞—Ç–∞–Ω–æ–π –ø—Ä–æ—Å—Ç–æ —Ä–∞–∑–æ—Ä–≤—ë–º –µ–π –ø–µ—Ä–¥–∞–∫',
'—Ç–≤–æ—è –º–∞–º–∞—à–∞ –¥–∞–∂–µ —Ä–∞—É–Ω–¥–∞ –ø—Ä–æ—Ç–∏–≤ –º–æ–µ–≥–æ —Ö—É—è –Ω–µ –≤—ã—Å—Ç–æ—è–ª–∞ —á—Ç–æ —Ç–µ–ø–µ—Ä—å –≥–≤–æ–æ—Ä–∏—Ç—å –æ –ø–æ–ª–Ω–æ—Ü–µ–Ω–æ–º –±–æ–µ –ø—É—Å—Ç—å —Ç—Ä–µ–Ω–∏—Ä—É–µ—Ç—å—Å—è –∞ –ø–æ–∫–∞ –æ–Ω–∞ —ç—Ç–æ –¥–µ–ª–∞—Ç—å –¥–∞–≤–∞–π —Å–æ—Å–∏ —Ä–∞–∫–∞–ª',
'–Ω–∞ —Ç–∞—Ä–∑–∞–Ω–∫–µ —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –∫–æ–≥–¥–∞ –æ–Ω–∞ –ø—ã—Ç–∞–ª–∞—Å—å —Å–ø—Ä—ã–≥–Ω—É—Ç—å —Å –Ω–µ—ë —è –ø–æ–¥—Ö–≤–∞—Ç–∏–ª –µ—ë —Ö—É—ë–º –∏ —É–µ–±–∞–ª –æ–± –∑–µ–º–ª—é –ø—É—Å—Ç—å —Ç–æ–ª—å–∫–æ –µ—â—ë —Ä–∞–∑ –ø–æ–ø—Ä–æ–±—É–µ—Ç –≤—ã–∫–∏–Ω—É—Ç—å —á—Ç–æ –Ω–∏–±—É–¥—å —Ç–∞–∫–æ–µ',
'–Ω–µ –º–æ–≥—É –Ω–µ —á–µ–≥–æ —Å–∫–∞–∑–∞—Ç—å –ø–ª–æ—Ö–æ–≥–æ –Ω–∞—Å—á—ë—Ç —Ç–≤–æ–µ–π –º–∞–º—É–ª—å–∫–µ –Ω–æ –ø—Ä–∏–¥—ë—Ç—å—Å—è —Ä–∞—Å–∫—Ä—ã—Ç—å —Ç–µ–±–µ —Ç–∞–π–Ω—É –æ—Ç—Å–æ—Å —Ç—ã –º–µ—Ä–∑–∫–∏–π —á—Ç–æ –æ–Ω–∞ —Ä–∞–¥–∏ –º–æ–µ–≥–æ —Ö—É—è —Ç–≤–æ–π –∫–æ–º–ø –∑–∞–ª–æ–∂–∏–ª–∞ –æ—Ä—É',
'–Ω–∞ —Å–∫–∞—á–∫–∞—Ö –≤—Å–µ –±—ã–ª–∏ –Ω–∞ –∫–æ–Ω—è—Ö –∞ —Ç–≤–æ—è –º–∞—Ç—å –µ–¥–∏–Ω—Å—Ç–≤–µ–Ω–∞—è —É—á–∞—Å—Ç–Ω–∏—Ü–∞ –∫–æ—Ç–æ—Ä–∞—è —Ä–µ—à–∏–ª–∞ –ø—Ä–æ—Å–∫–∞—Ç–∞—Ç—å –Ω–∞ –º–æ—ë–º —Ö—É–µ –Ω–µ —á—ë —Ç–∞–∫ –ø–æ–ª—É—á–∏–ª–æ—Å—å –∫—Å—Ç–∞—Ç–∏ –º–æ–π —Ö—É–π –≤–∑—è–ª —Ç–∞–º –ø–µ—Ä–≤–æ–µ –º–µ—Å—Ç–æ',
'—Ç–≤–æ—é –º–∞—Ç—å –∫–∞–∂–¥—ã–π –¥–µ–Ω—å —Ö—É—ë–º –≤ –º–∞–≥–∞–∑ –≥–æ–Ω—è—é –≤–µ–¥—å —è —Ç–∞–∫ –∑–∞–µ–±–∞–ª—Å—è –µ–π –Ω–∞ —Ä–æ—Ç–∞–Ω –¥–æ–≤–∞—Ç—å —á—Ç–æ —Ç–µ–ø–µ—Ä—å –º–æ—ë —Ä–∞–∑–≤–ª–µ—á–µ–Ω–∏—è —ç—Ç–æ –¥–µ–ª–∞—Ç—å –∏–∑ –Ω–µ—ë —Å–∞–º—É—é –ø–æ—Å–ª—É—à–Ω—É—é —à–ª—é—Ö—É',
'–º–æ–∂–µ—à—å –Ω–µ –≤–µ—Ä–∏—Ç—å –Ω–æ —Ç–≤–æ—é –º–∞—Ç—å –ø–µ—Ä–µ–±–∞–ª–∞ –ø–æ–ª –≥–æ—Ä–æ–¥–∞ –Ω–æ —è –µ–¥–∏–Ω—Å—Ç–≤–µ–Ω—ã–π –∑–∞ —á–µ–π —Ö—É–π –æ–Ω–∞ –±—É–¥–µ—Ç —Å—Ç–æ—è—Ç—å –¥–æ –∫–æ–Ω—Ü–∞ –∏ –Ω–µ –∫–æ–≥–¥–∞ –Ω–µ —Å–¥–∞—Å—Ç –∑–∞–¥–Ω–∏—é —Ä–∏–ª–∏',
'—Ç–≤–æ—è –º–∞—Ç—å –º–æ–π —Ö—É–π –º–µ—Å—Ç–æ –º–∞—Å–æ–∂–æ—Ä–∞ —Ä–µ—à–∏–ª–∞ –∏—Å–ø–æ–ª—å–∑—ã–≤–∞—Ç—å –Ω–æ —è –Ω–µ –∑–Ω–∞—é –µ—Å—Ç—å –ª–∏ –º–∞—Å–∞–∂–æ—Ä –ø–∏–∑–¥—ã –≤–µ–¥—å –µ–¥–∏–Ω—Å—Ç–≤–µ–Ω–Ω–æ–µ —á—Ç–æ –æ–Ω–∞ –¥–µ–ª–∞–µ—Ç —ç—Ç–æ —Å—É—ë—Ç –µ–≥–æ –≤ —Å–≤–æ—ë –≥–Ω–µ–∑–¥–æ',
'–¥–∞–∂–µ –Ω–∞ —Ä–∞–±–æ—Ç–µ —Ç–≤–æ—è –º–∞—Ç—å –∫–æ–≥–¥–∞ –≤—Å–µ –¥–µ–ª–∞—é—Ç –ø–ª–∞–Ω–æ–≤—ã–π –æ—á—ë—Ç –∏–ª–∏ –≤—ã—Ö–æ–¥—è—Ç –ø–æ–∫—É—Ä–∏—Ç—å –æ–Ω–∞ –º–Ω–µ –ø–æ —Å–∫–∞–π–ø—É —Å–æ—Å—ë—Ç –µ—Å–ª–∏ –±—ã–ª–æ –±—ã –≤–æ–∑–º–æ–∂–Ω–æ –Ω–µ –ø–ª–∞—Ç–∏—Ç—å –∑–∞ –º–æ–π —Ö—É–π –æ–Ω–∞ –±—ã –Ω–µ —Ä–∞–±–æ—Ç–∞–ª–∞',
'—É —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ —Å—Ç–µ—Ä–µ–æ—Ç–∏–ø–Ω–æ–µ –º—ã—à–ª–µ–Ω–∏—è –æ–Ω–∞ –¥—É–º–∞–µ—Ç —á—Ç–æ –µ—Å–ª–∏ —è –µ–π –Ω–µ –Ω–∞–≤–µ—Ä–Ω—É–ª –ø–æ –≥–æ—Ä–±—É –∑–∞ –ø–ª–æ—Ö–æ–π –º–∏–Ω—å–µ—Ç —Ç–æ –±–æ–ª—å—à–µ —Ç–∞–∫ –¥–µ–ª–∞—Ç—å –∏ –Ω–µ –±—É–¥—É –∫–∞–∫ –Ω–∞ –æ—à–∏–±–∞–µ—Ç—å—Å—è',
'—Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –ª–∏–Ω–∏—é –∂–∏–∑–Ω–∏ —Ö—É—ë–º –æ–±–æ—Ä–≤–∞–ª —Ç–µ–ø–µ—Ä—å –µ–π –ø—Ä–∏–¥—ë—Ç—å—Å—è –æ—Ç–ø—Ä–∞–≤–ª—è—Ç—å—Å—è –≤ –º–∏—Ä –∏–Ω–æ–π –Ω–∞ –∑–Ω–∞—è –∫–∞–∫–∞—è —Ç–≤–æ—è –º–∞–º–∞—à–∞ —à–ª—é—Ö–∞ –æ–Ω–∞ –¥–∞–∂–µ —Ç–∞–º –ø–æ–ø—Ä–æ—Å–∏—Ç –º–æ–π —Ö—É–π',
'–º–æ–π —Ö—É–π —Ç–≤–æ—é –º–∞—Ç—å –∂–µ –Ω–∞ –≤–µ—Ä—Ö–∫—É—à–∫—É –∑–∞–∫–∏–Ω—É–ª —Ç–µ–ø–µ—Ä—å –æ–Ω–∞ –æ–±—â–∞–µ—Ç—å—Å—è —Å –∏–Ω—Ç–µ–ª–µ–≥–µ–Ω—Ç–Ω—ã–º–∏ –ª—é–¥—å–º–∏ –Ω–æ –º—ã —Ç–æ –≤—Å–µ –∑–Ω–∞–µ–º –∫–∞–∫ –º—ã —Å –ø–∞—Ü–∞–Ω–∞–º–∏ –µ—ë —Ä–æ—Ç–∞–Ω –ø–æ –∫—Ä—É–≥—É –ø—É—Å–∫–∞–ª–∏',
'–Ω–µ –æ—Ç—Ä–∏—Ü–∞–π —Ç–æ–≥–æ —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å —Å–¥–∞–ª–∞—Å—å –º–æ–µ–º—É —Ö—É—é –æ–Ω–∞ –ø—ã—Ç–∞–ª–∞—Å—å —Å–æ–ø—Ä–æ—Ç–∏–≤–ª—è—Ç—å—Å—è –Ω–æ –º–æ–π —Ö—É–π –æ–∫–∞–∑–∞–ª—Å—è —Å–∏–ª—å–Ω–µ–µ –¥–∞–∂–µ —Ç–≤–æ–π –æ–ø—É—â–µ–Ω—ã–π –æ—Ç–µ—Ü —Å –Ω–∏–º –Ω–µ —Å–º–æ–≥ —Å–ø—Ä–∞–≤–∏—Ç—å—Å—è',
'–º–æ–∂–µ—Ç —Ç—ã –º–Ω–µ —Å–∫–∞–∂–µ—à—å –ø–æ—á–µ–º—É —Ç–≤–æ—è –º–∞—Ç—å –µ–±—É—á–∞—è –º–æ–ª–µ–∫—É–ª–∞ –æ–ø—è—Ç—å —Ä–µ—à–∏–ª–∞ –≤—ã–≤–µ—Å–∏—Ç—å –Ω–∞ —Å—Ç–µ–Ω–¥ –º–æ–π —Ö—É–π –æ–Ω–∞ —É–∂–µ –ø—Ä–æ–¥–∞–ª–∞—Å—å –µ–º—É –ø–æ–ª–Ω–æ—Å—Ç—å—é —Ä–∏–ª–∏',
'–Ω–µ –∑–∞–±—ã–≤–∞–π –∫—Ç–æ —Ç–≤–æ—é –º–∞—Ç—å —Ö—É—ë–º —É–µ–±–∞–ª –∏ –≤—Å—ë —ç—Ç–æ –±—ã–ª–æ –≤–æ –±–ª–∞–≥–æ –≤–µ–¥—å —Ç–µ–ø–µ—Ä—å –æ–Ω–∞ —Å—Ç–∞–ª–∞ —É–º–Ω–µ–µ –∏ –º–µ—Å—Ç–æ –æ—Ç—Å–æ—Å–∞ —Ç–≤–æ–µ–º—É –±–∞—Ç–∏ —Ç–µ–ø–µ—Ä—å –æ–Ω–∞ –¥–µ–ª–∞–µ—Ç –µ–≥–æ –º–Ω–µ',
'–º–æ–∂–µ—Ç —Ç—ã —â–∞—Å —É–ø–∞–¥—ë—à—å –Ω–∞ –∫–æ–ª–µ–Ω–∏ –∏ –Ω–∞—á–Ω—ë—à—å –º–Ω–µ —Å–æ—Å–∞—Ç—å –∞ —Ç–æ —è –ø–æ–∑–æ–≤—É —Ç–≤–æ—é –º–∞—Ç—å –∏ –æ–Ω–∞ —É–∂–µ –Ω–µ —Å–º–æ–∂–µ—Ç –æ—Ç–æ—Ä–≤–∞—Ç—å—Å—è –æ—Ç –º–æ–µ–≥–æ —Ö—É—è',
'—è –∂–µ —Ö—É—ë–º —Ç–≤–æ–π –ø–∏–∑–¥–∞–∫ –ø–æ–¥–≤–µ—Å–∏–ª –Ω–∞ –ª—é—Å—Ç—Ä—É —Ç–µ–ø–µ—Ä—å —Ç–≤–æ–π –±–∞—Ç—è –∫–æ–≥–¥–∞ –ø—Ä–æ—Ö–æ–¥–∏—Ç —Ä–∞–¥—É–µ—Ç—å—Å—è —á—Ç–æ —Ç–µ–±—è –≤—ã–µ–±–∞–ª –Ω–µ –∫–∞–∫–æ–π —Ç–æ –¥–æ–≤—Ä–æ–≤—ã–π –ø–∞—Ü–∞–Ω –∞ —è',
'–º–æ–∂–µ—Ç —Ç—ã –º–æ–π —Ö—É–π —Å–±–∞–ª–∞–Ω—Å–∏—Ä–æ–≤–∞–Ω–Ω–æ –Ω–∞—á–Ω—ë—à—å —Å–æ—Å–∞—Ç—å –∞ —Ç–æ —á—ë —Ç—ã –∫–∞–∫ –ª–∞—Ö –∑–∞ –æ–¥–Ω—É —â—ë–∫—É –ø—É—Å–∫–∞–µ—à—å –¥–∞–≤–∞–π –ø—Ä–µ—Å—Ç—É–ø–∞–π –∏–ª–∏ –æ–ø—è—Ç—å —Ç–≤–æ–π –±–∞—Ç—è –ø—Ä–∏–¥—ë—Ç –∏ –æ—Ç—Å–æ—Å—ë—Ç –º–Ω–µ',
'—Ç–≤–æ–π –±–∞—Ç—è –Ω—É–ª—ë–≤–∫–∞ –Ω–µ —á–µ–≥–æ –Ω–µ –º–æ–∂–µ—Ç –±–µ–∑ –º–æ–µ–≥–æ —Ö—É—è –≤–µ–¥—å –æ–Ω –≥–æ–≤–æ—Ä–∏—Ç —á—Ç–æ —ç—Ç–æ –µ–≥–æ —Å–≤–µ—Ç–ª—ã–π –ª—É—á–∏–∫ –≤ –±—É—â—É–µ–µ –≤–æ—Ç —ç—Ç–æ —è –µ–º—É —Ö—É—ë–º –º–æ–∑–≥–∏ –æ—Ç–±–∏–ª',
'–Ω–µ –≤–µ—Ä—å —Å–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –∫–æ–≥–¥–∞ –æ–Ω–∞ –≥–æ–≤–æ—Ä–∏—Ç —á—Ç–æ —è —Ç–µ–±—è –Ω–µ —Ä–∞–∑—É –Ω–µ –µ–±–∞–ª —è —Ç—è –µ—â—ë —Å —Ä–æ–∂–¥–µ–Ω–∏—è –µ–±–∞–ª –∫—Ä–µ–≤–µ—Ç–∫–∞ –µ–±—É—á–∞—è',
'–µ—â—ë –æ–¥–Ω–æ —Å–ª–æ–≤–æ –ø—Ä–æ —Ç–≤–æ—é –º–∞—Ç—å —è —Ç–µ–±—è —Ö—É—ë–º —Ä–∞—Å—Ç–µ—Ä–∑–∞—é –¥—É—Ä–∞ —Ç—ã –µ–±–∞–Ω–∞—è –≤–µ–¥—å —Ç–≤–æ—è –º–∞—Ç—å –∏–¥–µ–∞–ª—å–Ω–∞—è —à–∞–ª–æ–≤–∞ –Ω–µ –æ–±–∏–∂–∞–π –µ—ë',
'—Ç—ã –∑–Ω–∞–ª —á—Ç–æ —è —Ç—è —Ö—É—ë–º –∫—Ä–µ—Å—Ç–∏–ª –∞ —Ç–≤–æ—è –º–∞—Ç—å —É–º—É–¥—Ä–∏–ª–∞—Å—å –¥–∞–∂–µ –≤ —Ç–∞–∫–æ–π –æ—Ç–≤–µ—Ç—Å—Ç–≤–µ–Ω—ã–π –º–æ–º–µ–Ω—Ç –æ—Ç—Å–æ—Å–∞—Ç—å —Å–≤—è—â–µ–Ω–∏–∫—É',
'—è —Ç–µ–±—è –¥–∞–∂–µ –≤ –¥–µ—Ç—Å–∫–æ–º —Å–∞–¥—É –µ–±–∞–ª –∫–æ–≥–¥–∞ —Ç—ã –¥—Ä–∞–ª—Å—è –∑–∞ –º–∞—à–∏–Ω–∫–µ –∏ –ø–ª–∞–∫–∞–ª —á—Ç–æ —Ç–µ–±—è –Ω–µ –¥–∞–ª–∏ –º–∞—à–∏–Ω–∫—É –∫—Ç–æ —Ç–µ —Ö—É–π –æ—Ç –æ–±–∏–¥—ã —Å—É–≤–∞–ª',
'—Ç—ã —Å—Ç–∞–ª –ø–æ—Ö–æ–∂–∏–º –Ω–∞ —Å–≤–æ—é –º–∞—Ç—å —Ç–µ–±–µ —É–∂–µ —Ç–æ–∂–µ –Ω–µ –Ω—É–∂–Ω–∞ –ø—Ä–∏—á–∏–Ω–∞ —á—Ç–æ–±—ã –æ—Ç—Å–æ—Å–∞—Ç—å –º–Ω–µ —Ö—É–π –Ω—É –µ—Å–ª–∏ —Ç–∞–∫ —Ç–æ —Ç—ã —Ç–æ–∂–µ –¥–æ—Å—Ç–æ–µ–Ω –∑–≤–∞–Ω–∏—è –ø–¥–∑–æ–±–æ—Ä–Ω–æ–π —à–ª—é—Ö–∏',
'–Ω–µ –º–æ–≥—É –ø–æ–≤–µ—Ä–∏—Ç—å —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å –æ–ø—è—Ç—å –≤–∑—è–ª–∞—Å—å –∑–∞ —Å—Ç–∞—Ä–æ–µ –∏ –ø—ã—Ç–∞–µ—Ç—å—Å—è –≤—ã—Å–ª–µ–¥–∏—Ç—å –º–æ–π —Ö—É–π –Ω—É –µ—Å–ª–∏ –æ–Ω–∞ –ø–æ–ø–∞–¥—ë—Ç—å—Å—è –º–Ω–µ –Ω–∞ –≥–ª–∞–∑–∞ —è –µ—ë —Ö—É—ë–º –≤ –ê—Ä–∞—Ö–Ω–≥–µ–ª—å—Å–∫ —à–≤—ã—Ä–Ω—É',
'–Ω–µ –¥—É–º–∞–π –Ω–µ —á–µ–≥–æ –ø–ª–æ—Ö–æ–≥–æ –Ω–æ —Ç–≤–æ—è –º–∞—Ç—å –∫–æ—Å–º–æ–Ω–∞–≤—Ç —è —Ç–µ–±–µ –Ω–µ –≤—Ä—É –Ω–µ –≤ –∫–æ–µ–º —Å–ª—É—á–∞–µ –∞ –∑–Ω–∞–µ—à—å –Ω–∞ —á—ë–º –ø—Ä–æ—Ö–æ–¥–∏–ª –µ—ë –ø–µ—Ä–≤—ã–π –ø–æ–ª—ë—Ç –Ω–∞ –º–æ—ë–º —Ö—É–µ –æ—Ä—É',
'–º–æ–∂–µ—Ç —è —Ç–µ–±—è –æ–≥–æ—Ä—á—É –Ω–æ —Ç–≤–æ—è –º–∞—Ç—É—à–∫–∞ —â–∞ –º–Ω–µ —Ö—É–π —Å–æ—Å—ë—Ç –∏ —á—Ç–æ —Ç–æ –±–æ—Ä–º–æ—á–µ—Ç —ç—Ç–æ —à–∞–ª–æ–≤–∞ –º–µ–Ω—è —Ç–∞–∫ –∑–∞–µ–±–∞–ª–∞ —è —â–∞ –≤—Å–ø–æ—Ä—é –µ—ë —Ö—É—ë–º –ø—Ä–∏—Ö–æ–¥–∏ –∏ –∑–∞–±–∏—Ä–∞–π –µ—ë',
'–≤—Å—ë –Ω–µ —Ç–∞–∫ –ø—Ä–æ—Å—Ç–æ —É —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –µ—Å—Ç—å —Å—Ç–∏–º—É–ª —Å–æ—Å–∞—Ç—å –º–Ω–µ —Ö—É–π –≤–µ–¥—å —è —Å–∫–∞–∑–∞–ª –µ—Å–ª–∏ –æ–Ω–∞ –æ—Å—Ç–∞–Ω–æ–≤–∏—Ç—å—Å—è —Ç–æ —Ç–≤–æ–π –≥—Ä—è–∑–Ω—ã–π –±–∞—Ç—è —É–º—Ä—ë—Ç',
'—Ç–≤–æ—è –º–∞—Ç—å –Ω–∞ –º–æ—ë–º —Ö—É–µ —Ö–∏–ø —Ö–æ–ø —Ç–∞–Ω—Ü–µ–≤–∞–ª–∞ –∏ —Å—É–¥—å—è –¥–∞–ª–∏ –µ–π –ø–µ—Ä–≤–æ–µ –º–µ—Å—Ç–æ –Ω–æ –Ω–µ –∑–∞ —ç—Ç–æ –∞ –∑–∞ –≤–µ–ª–∏–∫–æ–ª–µ–ø–Ω—ã–π –æ—Ç—Å–æ—Å –≤ –∫–æ–Ω—Ü–µ',
'—Ö–æ—á–µ—à—å —Å–ø–∞—Å—Ç–∏ —Å–≤–æ—é –º–∞—Ç—å –∏–∑ —Ä–∞–±—Å—Ç–∞–≤–∞ –º–æ–µ–≥–æ —Ö—É—è –ø—Ä–∏–Ω–µ—Å–∏ –µ–º—É –ø–æ–¥–Ω–æ—à–µ–Ω–∏—è —Ç–æ–≥–¥–∞ –º–æ–∂–µ—Ç –±—ã—Ç—å –º–æ–π —Ö—É–π –ø—Ä–æ—Å—Ç–∏—Ç —Ç–≤–æ—é –º–∞—Ç—É—Ö—É',
'—Ç–≤–æ—è –º–∞—Ç—å —É–∂–µ –æ—Ç–∂–∏–ª–∞ —Å–≤–æ—ë –Ω–∞ –º–æ—ë–º —Ö—É—é –∫–∞–∫ –∏ —Ç–≤–æ–π –æ—Ç–µ—Ü –ø—Ä–∏—à–ª–æ —Ç–≤–æ—ë –≤—Ä–µ–º—è –ø—Ä—ã–≥–∞–π –Ω–∞ —Ö—É–π –∏ –ø–æ–µ—Ö–∞–ª–∏ –¥—É—Ä–µ–Ω—å',
'—Ç–≤–æ—è –º–∞—Ç—å –º–µ—Å—Ç–æ —Ç–∞–±–ª–µ—Ç–æ–∫ –æ—Ç –≥–æ–ª–æ–≤—ã –≥–ª–æ—Ç–∞–µ—Ç –º–æ–π —Ö—É–π —Å–∫–∞–∂–µ—à—å —á–µ–º —ç—Ç–æ –ø–æ–º–æ–∂–µ—Ç —Å–ø—Ä–æ—Å–∏ —É —ç—Ç–æ–π –µ–±—É—è–µ–π –¥—É—Ä—ã',
'—Ç–≤–æ—è –º–∞—Ç—å –ø—ã—Ç–∞–ª–∞—Å—å –≤—ã–≤–µ–∑—Ç–∏ –º–æ–π —Ö—É–π –ø–æ –ø–æ–Ω—è—Ç–∏—è–º —á—Ç–æ–±—ã –æ–Ω –±–æ–ª—å—à–µ –µ—ë –Ω–µ —Ç—Ä–æ–≥–∞–ª –Ω–æ –º–æ–π —Ö—É–π –Ω–µ —Å—Ç–∞–ª –µ—ë —Å–ª—É—à–∞—Ç—å –∏ —Ä–∞—Å—ë–∫ –µ–π –±—Ä–æ–≤—å',
'–º–æ–∂–µ—Ç —Ç—ã –±—É–¥–µ—à—å –¥—É–º–∞—Ç—å —á—Ç–æ —è –ø–ª–æ—Ö–æ–π –Ω–æ —è –¥–æ–∫–∞–∂—É –æ–±—Ä–∞—Ç–Ω–æ–µ –µ—Å–ª–∏ –±—ã —è –Ω–µ –µ–±–∞–ª —Ç–≤–æ—é –º–∞—Ç—å –µ—ë –±—ã –µ–±–∞–ª –≤–µ—Å—å –≥–æ—Ä–æ–¥ –∏ –≤—Å–µ –±—ã –∑–Ω–∞–ª–∏ —á—Ç–æ –æ–Ω–∞ —à–∞–ª–æ–≤–∞ –∞ —Ç–∞–∫ –∑–Ω–∞–µ–º —Ç–æ–ª—å–∫–æ –º—ã',
'–º–æ–≥—É –æ–±—Ä–∞—Ç–∏—Ç—å—Å—è —Å –ø—Ä–æ—Å—å–±–æ–π –∫ —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ —Ç—ã —Å–ø—Ä–æ—Å–∏—à—å –∫–∞–∫–æ–π –Ω—É —Ç—ã —á—ë –ª–∞—Ö –Ω–µ –ø–æ–Ω–∏–º–∞–µ—à—å —á—Ç–æ–±—ã –æ–Ω–∞ –æ—Ç—Å–∞—Å–∞–ª–∞ –º–Ω–µ',
'–Ω–µ –∫–∞–∫–æ–π –µ–±–∞–ª —Ç–≤–æ—è –º–∞—Ç—å –∫–æ–≥–¥–∞ —É –º–µ–Ω—è –±—ã–ª–∞ —Ç–µ–º–ø–µ—Ä–∞—Ç—É—Ä–∞ —Ä–æ—Ç —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –∑–∞–º–µ–Ω—è–ª –º–Ω–µ –≥—Ä–∞–¥—É—Å–Ω–∏–∫',
'–Ω–∞ —Å–ø–∏–Ω–µ —Ç–≤–æ—è –º–∞—Ç—å –Ω–∞–∫–æ–ª–æ–ª–∞ –º–æ–π —Ö—É–π –∏ —Ç–µ–ø–µ—Ä—å —Ö–≤–∞—Å—Ç–∞–µ—Ç—å—Å—è –≤—Å–µ–º —á—Ç–æ —É –Ω–∏—Ö –Ω–µ—Ç –±–æ–ª–µ–µ –æ—Ö—É–µ–Ω–µ–µ —Ç–∞—Ç—É–∏—Ä–æ–≤–∫–æ–π —á–µ–º —É –Ω–µ—ë',
'—Ç–≤–æ—é –º–∞—Ç—å –≤ –∑–∏–º—É –µ–±–∞–ª —Ç–æ–≥–¥–∞ –∫–∞–∫ —Ä–∞–∑ –±—ã–ª –∂–µ—Å—Ç–æ–∫–∞—è –∑–∏–º–∞ –∏ –º–Ω–µ –ø—Ä–∏—à–ª–æ—Å—å –µ–±–∞—Ç—å —Ç–≤–æ—é –º–∞—Ç—å —á—Ç–æ–±—ã —Å–æ–≥—Ä–µ—Ç—å—Å—è',
'–Ω–∞ –º–∞—à–∏–Ω–µ —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –≤—Å–µ —Å–∫–∞–∂—É—Ç —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å –µ–±—É—á–∞—è —à–∞–ª–æ–≤–∞ –∫–æ—Ç–æ—Ä–∞—è –≤–µ–¥–µ—Ç—å—Å—è –Ω–∞ —Ç–∞—á–∫–∏ –Ω–æ –æ–Ω–∏ –æ—à–∏–±–∞—é—Ç—å—Å—è –æ–Ω–∞ –≤–µ–¥—ë—Ç—å—Å—è –Ω–∞ –º–æ–π —Ö—É–π',
'–Ω–∞ –≤–∏–ª–µ —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –∏ –º–æ–∂–Ω–æ —Å–∫–∞–∑–∞—Ç—å —á—Ç–æ –º—ã –≤–æ—Ä–≤–∞–ª–∏—Å—å —Ç—É–¥–∞ –Ω–µ –∑–∞–∫–æ–Ω–Ω–æ –∞ –∑–Ω–∞–µ—à—å –ø–æ—á–µ–º—É –ø–æ—Ç–æ–º—É —á—Ç–æ —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –∑–∞—Ö–æ—Ç–µ–ª–æ—Å—å –ø–æ—Å–æ—Å–∞—Ç—å –º–æ–π —Ö—É–π —ç–∫—Å—Ç—Ä–µ–º–∞–ª—å–Ω–æ',
'–∑–Ω–∞–µ—à—å –ø–æ—á–µ–º—É –º–µ–Ω—è –≤—Å–µ –ø–∞—Ü–∞–Ω—ã –Ω–∞–∑—ã–≤–∞–ª–∏ —Ö—É–ª–∏–≥–∞–Ω–æ–º –ø–æ—Ç–æ–º—É —á—Ç–æ —è —Ç–≤–æ—é –º–∞—Ç—É—Ö–∞ –ø–æ—Å–ª–µ 8 –µ–±–∞–ª',
'–º—ã –ª—é–±–∏–ª–∏ —Å–æ–±–∏—Ä–∞—Ç—å—Å—è —Å –ø–∞—Ü–∞–Ω–∞–º–∏ –∏ –≥–æ–≤–æ—Ä–∏—Ç—å –æ —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –Ω–æ —Ä–∞–∑–≥–æ–≤–æ—Ä –æ–±—ã—á–Ω–æ –∑–∞–∫–∞–Ω—á–∏–≤–∞–ª—Å—è –æ–¥–Ω–∏–º –º—ã –∑–≤–æ–Ω–∏–ª–∏ —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ —á—Ç–æ–±—ã –æ–Ω–∞ –æ—Ç—Å–∞—Å–∞–ª–∞ –Ω–∞–º —Ö—É–π –Ω–µ —Ä–∞–∑—É –Ω–µ –æ—Ç–∫–∞–∑—ã–≤–∞–ª–∞',
'–≤ –º—É—Å–æ—Ä—Å–∫–æ–º —É—á–∞—Å—Ç–∫–µ —Ç–≤–æ—é –º–∞—Ç—å –ø–æ–µ–±–∞–ª –∫–æ–≥–¥–∞ –µ—ë –∑–∞–∫—Ä—ã–ª–∏ –∑–∞ –¥–µ—Ä–∑–∫–æ–µ —Å–æ—Å–∞–Ω–∏—è –º–æ–µ–≥–æ —Ö—É—è —è –ø—Ä–æ–±—Ä–∞–ª—Å—è —Ç—É–¥–∞ –∏ –≤—ã–µ–±–∞–ª –µ—ë –ø—Ä–∞–≤–∏–ª—å–Ω–æ –∂–µ —Ö–µ—Ö',
'–Ω–∞ –¥–µ–Ω—å –æ—Ç–∫—Ä—ã—Ç—ã—Ö –¥–≤–µ—Ä–µ–π —Ç–≤–æ—é –º–∞—Ç—å –ø–æ–µ–±–∞–ª –∫–æ–≥–¥–∞ –≤—Å–µ —Å–æ–±–∏—Ä–∞–ª–∏—Å—å –∏ –±—ã–ª–∏ —Å–æ—Å—Ä–µ–≥–æ—Ç–æ—á–µ–Ω—ã —è —Ç–æ–∂–µ –±—ã–ª –≤ —Å–≤–æ—ë–º –ø–æ–Ω–∏–º–∞–Ω–∏—è –Ω–∞–≤–æ—Å—Ç—Ä—ë–Ω –Ω–æ —è –µ–±–∞–ª —Ç–≤–æ—é –º–∞—Ç—å',
'–Ω–∞ –∑–∞–ø—Ä–∞–≤–∫–µ —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –ø–æ–∫–∞ –≤—Å–µ –∑–∞–ø—Ä–∞–≤–ª—è–ª–∏ –º–∞—à–∏–Ω—ã —è –∑–∞–ø—Ä–∞–≤–ª—è–ª —Å–ø–µ—Ä–º–∞–∫–æ–º —Ç–≤–æ—é –∂–∞–ª–∫—É—é –º–∞—Ç—É—Ö—É',
'–Ω–∞ –∞–≤—Ç–æ—Å—Ç–∞–Ω—Ü–∏–∏ —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –ø–æ–∫–∞ —Ö–æ–¥–∏–ª–∏ –∞–≤—Ç–æ–±—É—Å—ã –º–æ–π —Ö—É–π –∑–æ–¥–∏–ª –≤–Ω—Ç—É—Ä–∏ —Ç–≤–æ–µ–π –º–∞—Ç—É—à–∫–µ –æ—Ä—É –¥—É—Ä–µ–Ω—å',
'–Ω–∞ –º–æ—Ä–µ —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –Ω–æ —Ç–∞–º –ø–æ–ø—ã—Ç–∞–ª–∏—Å—å —É –º–µ–Ω—è –µ—ë —Å–ø–∏–∑–¥–µ—Ç—å –Ω–æ –æ–Ω–∞ –≤–µ—Ä–Ω—É–ª–∞—Å—å –∑–∞ 1000 –∫–º –∫–æ –º–Ω–µ –≤–µ–¥—å –æ–Ω–∞ –≤–µ—Ä–Ω–∞ –º–æ–µ–º—É —Ö—É—é',
'–Ω–∞ –∫–∞—Ä–∏–±—Å–∫–∏—Ö –æ—Å—Ç—Ä–æ–≤–∞—Ö —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –æ–Ω–∞ —Ä–µ—à–∏–ª–∞ —à–∏–∫–∞–Ω—É—Ç—å –∏ –ø–æ–µ—Ö–∞–ª–∞ –Ω–∞ –æ—Å—Ç—Ä–æ–≤–∞ –Ω–æ –≤–∑—è–ª–∞ –º–µ–Ω—è –≤–µ–¥—å –∫—Ç–æ –µ–π —Ç–∞–º –Ω–∞ —Ä–æ—Ç–∞–Ω –∫–∏–¥–∞—Ç—å –±—É–¥–µ—Ç',
'–Ω–∞ –∑–∞–∫–∞—Ç–µ —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –≤—Å—ë –±—ã–ª–æ —Ç–∞–∫ –∫—Ä–∞—Å–∏–≤–æ –∫—Ä–æ–º–µ –µ–±–∞–ª–∞ —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –ø—Ä–∏—à–ª–æ—Å—å –Ω–∞ —ç—Ç—É –¥—É—Ä—É –º–µ—à–æ–∫ –Ω–∞–¥–µ–≤–∞—Ç—å',
'–Ω–∞ –≤–µ—Ä—Ç–æ–ª—ë—Ç–µ —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –µ–π –±—ã–ª–æ —Å—Ç—Ä–∞—à–Ω–æ –ª–µ—Ç–µ—Ç—å –∏ —á—Ç–æ–±—ã —É—Å–ø–æ–∫–æ–∏—Ç—å –µ—ë –º–Ω–µ –ø—Ä–∏—à–ª–æ—Å—å –ø–æ—Ä–≤–∞—Ç—å –µ–π —Ç–∞–º –∞–Ω–∞–ª',
