'–Ω–∞ –ª—É–Ω–µ —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –ø–æ–∫–∞ —Ç–≤–æ—è –º–∞—Ç—å –±—ã–ª–∞ –≤ –≤–æ—Å—Ç–æ—Ä–≥–µ –æ—Ç –∫–æ—Å–º–æ—Å–∞ —è –µ—ë –µ–±–∞–ª –ª–∞–π–∫–Ω–∏ –∑–∞–ø–∏—Å–∏ –µ—Å–ª–∏ —è –ø–æ—Å—Ç—É–ø–∏–ª –ø—Ä–∞–≤–∏–ª—å–Ω–æ',
'–Ω–∞ –ø—Ä–æ–≤–æ–¥–∞—Ö —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –ø–æ–∫–∞ —Ç–≤–æ—è –º–∞—Ç—É—Ö–∞ –ø—Ä–æ–≤–∞–∂–∞–ª–∞ —Ç–≤–æ–µ–≥–æ –±–∞—Ç—é –≤ –∞—Ä–º–∏—é –æ–Ω–∞ –ø—É—Å—Ç–∏–ª–∞ —Å–ª–µ–∑—É –Ω–æ –≤—Å–µ –∑–Ω–∞–ª–∏ –∫—Ç–æ –±—É–¥—É—â–∏–π –≥–æ–¥ –±—É–¥–µ—Ç –µ–π –Ω–∞ —Ä–æ—Ç–∞–Ω –∫–∏–¥–∞—Ç—å',
'–Ω–∞ –ø–∏—Ç —Å—Ç–æ–ø–µ —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –∫–æ–≥–¥–∞ –æ–Ω–∞ –ø—Ä—ã–≥–∞–ª–∞ –≤ —Ç–∞—á–∫–µ –∫ —á—É–∂–∏–º –º—É–∂–∏–∫–∞–º –æ–Ω–∏ —Ä–∞—Å—á–∏—Ç—ã–≤–∞–ª–∏ –Ω–∞ —á—Ç–æ —Ç–æ –Ω–æ –ø–æ—Ç–æ–º –ø–æ–Ω—è–ª–∏ —á—Ç–æ —Å–æ—Å—ë—Ç –æ–Ω–∞ —Ç–æ–ª—å–∫–æ –º–Ω–µ',
