'–Ω–∞ –≤–æ–ª–Ω–µ —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –ø–æ–∫–∞ —Ç–≤–æ—è –º–∞—Ç—å –Ω–µ –Ω–∞—É—á–∏–ª–∞—Å—å –µ–∑–¥–∏—Ç—å –Ω–∞ –º–æ—ë–º —Ö—É—é –æ–Ω–∞ –Ω–µ –ø–µ—Ä–µ—à–ª–∞ –∫ —Å—ë—Ä—Ñ–Ω–æ–π –¥–æ—Å–∫–µ',
