'–Ω–∞ –∫–æ—Ä–∞–±–ª–µ —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –ø–æ–∫–∞ –≤—Å–µ –Ω—ã–∫–∞–ª–∏ –æ—Ç —à—Ç–æ—Ä–º–∞ —Ç–≤–æ—è –º–∞—Ç—å —Å–ø–µ—Ü–∏–∞–ª—å–Ω–æ –≤—ã–±–µ–≥–∞–ª–∞ –Ω–∞ –ø–∞–ª—É–±—É –∏ —Å–æ—Å–∞–ª–∞ –º–Ω–µ —Ö—É–π –∫–∞–∫ –Ω–µ–Ω–æ—Ä–º–∞–ª—å–Ω–∞—è',
'–Ω–∞ —Å–≤–∞–ª–∫–µ —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª —Ç—ã —Å–ø—Ä–æ—Å–∏—à—å –∫–∞–∫ —è —Ç—É–¥–∞ –∑–∞—à—ë–ª –≤—Å—ë –ø—Ä–æ—Å—Ç–æ —è —Ö–æ—Ç–µ–ª –≤—ã–±—Ä–æ—Å–∏—Ç—å –º—É—Å–æ—Ä –∞ —Ç–∞–º –ª–µ–∂–∞–ª–∞ —Ç–≤–æ—è –º–∞—Ç—å –Ω–µ–ø–ª–æ—Ö–æ —Ç–æ–≥–¥–∞ –≤—ã–µ–±–∞–ª –µ—ë',
