'–Ω–∞ –∫—Ä–∞—é —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª —É –Ω–µ—ë –ø—Ä–æ—Å—Ç–æ –Ω–µ –±—ã–ª–æ –≤—ã—Ö–æ–¥–∞ —É–±–µ–∂–∞—Ç—å –æ—Ç –º–æ–µ–≥–æ —Ö—É—è –æ—Ä—É –æ–Ω–∞ —Ç–∞–∫ –∏ –Ω–µ –ø–æ–Ω—è–ª–∞ —á—Ç–æ –æ—Ç –º–æ–µ–≥–æ —Ö—É—è –Ω–µ –æ—Å–≤–æ–±–æ–¥–∏—Ç—å—Å—è',
'–Ω–∞ –ø–∞—Ä–∞–¥–µ —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –∫–æ–≥–¥–∞ –≤—Å–µ –∫—Ä–∞—Å–∏–≤–æ –º–∞—Ä—à–µ—Ä–æ–≤–∞–ª–∏ —è –∫—Ä–∞—Å–∏–≤–æ –µ—ë –µ–±–∞–ª –∞ –∑–Ω–∞–µ—à—å –∫–∞–∫ —è —ç—Ç–æ –ø–æ–Ω—è–ª –≤ –∫–æ–Ω—Ü–µ –ø—É—Å–∫–∞–ª–∏ —Å–∞–ª—é—Ç –≤ —á–µ—Å—Ç—å –º–æ–µ–≥–æ —á–ª–µ–Ω–∞',
