'–Ω—É –∂–µ –ø–æ—ä—è—Å–Ω–∏ –º–Ω–µ —Ö–æ—Ç—è –±—ã –∑–∞ —Ç–æ —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å —É –∫–∞–∂–¥–æ–≥–æ –ø—Ä–æ—Ö–æ–∂–µ–≥–æ –≤ —Ä–æ—Ç –±–µ—Ä–µ—Ç –∏–ª–∏ –æ–ø—è—Ç—å —Å–∫–∞–∂–µ—à—å —ç—Ç–æ –≤—Å—ë –ø–æ—Ç–æ–º—É —á—Ç–æ –º–Ω–µ –Ω—É–∂–µ–Ω —Ç–æ–ø–æ–≤—ã–π –¥–¥',
'—Ç—ã –¥–∞–≤–∞–π –º–Ω–µ —Ç—É—Ç –Ω–µ –æ—Ç–∫–∏–Ω—å—Å—è —Ö–æ—Ç—è –±—ã –∑–∞ 3 –º–µ—Å—è—Ü–∞ –∞ —Ç–æ —è –≤–Ω–∞—Ç—É—Ä–µ –∑–∞–¥–∏–±–æ—à–∏—Ä—é –∏ —Ç–≤–æ—é –º–∞—Ç—å –≤ –ø—É—Ö –∏ –ø—Ä–∞—Ö —Å–æ—Ç—Ä—É –ø—Ä—è–º –∫–∞–∫ –º–∞—Ç—å —ç–∫—Å—Ç–∞–∑–∏',
'–Ω–µ —Ç—ã –≤–Ω–∞—Ç—É—Ä–µ –ø–∞—Ä–∞–≤–æ–∑ –µ–±–∞–Ω–Ω—ã–π —Ç—ã –Ω–∞—Ö—É–π —É –º–∞—Ç–µ—Ä–∏ –±—ã—á–∫–∏ –ø–∏–∑–¥–∏—à—å —è –∂–µ –µ–π —Å –ø–∞—Ü–∞–Ω–∞–º–∏ –Ω–∞ —Ä–æ—Ç–∞ –¥–∞–≤–∞–ª –∞ —Ç—ã –ø–æ—Å–ª–µ –Ω–µ—ë –∫—É—Ä–∏—à—å –≤–∞—Ñ—ë–ª –µ–±–∞–Ω–Ω—ã–π',
'–¥–∞–≤–∞–π —Ç—ã –º–Ω–µ —â–∞—Å —Ç—É—Ç —Ö—É–π –æ—Ç—Å–æ—Å–µ—à—å –∞ —è —Ç–µ–±—è –Ω–µ –±—É–¥—É –ø–∏–¥–∞—Ä–∞—Å–∏—Ç—å –ø–æ –≤—Å–µ–º—É —Ä—É–Ω–µ—Ç—É –≤–Ω–∞—Ç—É—Ä–µ –∂–µ –≤—ã–≥–æ–¥–Ω–æ –¥–ª—è —Ç–µ–±—è —Ñ–∞—Ä—à–º–∞–∫–∞',
'–Ω–µ –∑–∞–±—É–¥—å –∫–∞–∫ –ø—Ä–∏–¥–µ—à—å –¥–æ–º–æ–π —Å–∫–∞–∑–∞—Ç—å —Å–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ —á—Ç–æ —è –µ—ë —á–µ—Ö–ª–∏—Ç—å –±—É–¥—É –∏–ª–∏ —Ç—ã —Ä–µ–∏—à–ª –±–ª—è—Ç—å —á—Ç–æ —è —É–∂–µ –Ω–µ –µ–±—É —Ç–≤–æ—é –º–∞—Ç—å',
'–¥–∞–≤–∞–π —â–∞—Å –ø–æ–±–∞–∑–∞—Ä–∏–º –Ω–∞ —Å—á–µ—Ç —Ç–µ–º—ã —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å —à–ª—é—Ö–∞ —è –ø–æ–Ω–∏–º–∞—é —Ç–µ–±–µ –Ω–µ –ø—Ä–∏—è—Ç–Ω–æ –Ω–æ –µ–π –∂–µ –ø—Ä–∏—è—Ç–Ω–æ —á—Ç–æ –º—ã –µ—ë –µ–±—ë–º',
'–¥–∞–≤–∞–π —â–∞—Å —Ç—ã –∑–∞—Ç–∫–Ω—ë—à—å —Å–≤–æ—ë –µ–±–∞–ª–æ –∏ –ø—Ä–æ—Å—Ç–æ –ø—Ä–∏–∑–Ω–∞–µ—à—å —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å —à–ª—é—Ö–∞ –µ–±–∞–Ω–Ω–∞—è –∏ —á—Ç–æ —Ç–∞–∫–æ–π –≤—ã—Ä–æ–¥–æ–∫ –∫–∞–∫ —Ç—ã –µ–π –Ω–∞—Ö—É–π –Ω–µ —Å–¥–∞–ª—Å—è',
'–Ω–µ –∞ —Ç—ã —á—ë —â–∞—Å –ø—Ä–æ—Å—Ç–æ —Ç–∞–∫ –≤–æ–∑—å–º—ë—à—å –º–æ–π —Ö—É–π –∏ –æ—Ç—Å–æ—Å—ë—à—å –Ω—É —Ç—ã –¥–∞–≤–∞–π –æ–±–¥—É–º–∞–π —Å–µ—Ä—å–µ–∑–Ω–æ —Ç–æ —á—Ç–æ —è –ø–æ—Å–ª–µ —ç—Ç–æ–≥–æ –≤—Å–µ —Ä–∞–≤–Ω–æ –≤—ã–µ–±—É —Ç–≤–æ—é –º–∞—Ç—å',
'–Ω–µ –Ω—É —Ç—ã  —Ç–µ–±—è –≤–Ω–∞—Ç—É—Ä–µ —â–∞—Å —à–∞–º–∞—Ä–Ω—É —Ç—ã –ø–æ–π–¥—ë—à—å –≤ –º—É—Å–∞—Ä–Ω—é –∑–∞—è–≤—É –ø–∏—Å–∞—Ç—å –ø–æ–∫–∞ —è —Ç–≤–æ—é –º–∞—Ç—å –µ–±—É —É—Ç–∫–∞ –µ–±–∞–Ω–Ω–∞—è ',
'—è –∫–æ–≥–¥–∞ —Ç–≤–æ—é –º–∞—Ç—å –ø–æ–¥ –ø—Ä–∏—Ö–æ–¥–æ–º –≥–µ—Ä—ã—á–∞ –µ–±–∞–ª –æ–Ω–∞ –∫–∞–∑–∞–ª–∞—Å—å –∫—Ä–∞—Å–∏–≤–æ–π –≤ –∏—Ç–æ–≥–µ –∫–æ–≥–¥–∞ –º–µ–Ω—è –æ—Ç–ø—É—Å—Ç–∏–ª–æ —è –±–µ–∂–∞–ª –≤ —Å—Ç—Ä–∞—Ö–µ –æ—Ç —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏',
'—è –æ–±—ã—á–Ω–æ –ø—å—é –∑–∞ –¥–≤–µ –≤–µ—â–∏ –Ω–∞ –∑–∞ —Å—Ç–æ–ª—å–µ —á—Ç–æ–±—ã —Ö—É–π —Å—Ç–æ—è–ª –∏ —Ç–≤–æ—è –º–∞—Ç—å –ø–æ–±–ª–∏–∂–µ –±—ã–ª–∞',
'–Ω—É –¥–∞–≤–∞–π —è —Ç–≤–æ—ë —Ä—ã–ª–æ –≤ —ç—Ç–æ–π –∫—Ñ –æ–±–∫–æ–Ω—á–∞—é –∫–∞–∫ —Ç—ã –ø–æ—Ç–æ–º –±—É–¥–µ—à—å —Ä–∞—Å–∫–∞–∑—ã–≤–∞—Ç—å —Å–≤–æ–∏–º –¥—Ä—É–∑—å—è–º —á—Ç–æ —Ç—ã –º–µ–Ω—è –≤—ã–≤–µ–∑',
'—Ç–≤–æ—è –º–∞—Ç—å –æ—Ç –Ω–µ–¥–æ—Ç—Ä–∞—Ö–∞ –Ω–∞ –∫–∞–∂–¥—ã–π –∫–æ–ª –ª–µ–∑–µ—Ç —è —É–∂–µ –Ω–µ –∑–Ω–∞—é —á—ë –¥–µ–ª–∞—Ç—å –º–æ–∂–µ—Ç –æ—à–µ–π–Ω–∏–∫ –∫—É–ø–∏—Ç—å –∫–∞–∫ –¥—É–º–∞–µ—à—å',
'—è –∫–∞–∫ –∏–º–ø–µ—Ä–∞—Ç–æ—Ä —Ç–≤–æ—è –º–∞—Ç—å —É –º–µ–Ω—è –≤ –Ω–æ–≥–∞—Ö –ø–æ–ª–∑–∞–µ—Ç –Ω–æ –ø—Ä–∏ —ç—Ç–æ–º —è –∂–∏–≤—É –∫–∞–∫ –≤—Å–µ –Ω–æ –ø–æ—á–µ–º—É —Ç–≤–æ—è –≥–æ—Ä—è –º–∞—Ç—å –º–Ω–µ —Ç–æ —Å–æ—Å—ë—Ç',
'–µ—Å—Ç—å –ø—Ä–∏–ª–æ–∂–µ–Ω–∏—è –µ—Å–ª–∏ –∫—É–ø–∏—à—å 3 –ø–∞—á–∫–∏ —Å—É—Ö–∞—Ä–∏–∫–æ–≤ —Å–∫–∞–Ω–∏—Ä—É–µ—à—å —á–µ–∫ –∏ —Ç–µ–±–µ –±–µ—Å–ª–ø–∞—Ç–Ω–æ –≤—ã–ø–∞–¥–∞–µ—Ç —ë–± —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –æ—Ç –æ–¥–Ω–æ–≥–æ –¥–æ –¥–µ—Å—è—Ç–∏ —Ä–∞–∑',
'–Ω—É –∂–µ –¥–∞–≤–∞–π –æ–∫–ª–µ–º–∞–π—Å—è –æ—Ç –ø–æ–±–æ–µ–≤ –º–æ–µ–≥–æ —á–µ–ª–µ–Ω–∞ –∏ —Å–º–µ—Ä–∏—Å—å —Å –º—ã—Å–ª—å—é —á—Ç–æ –µ–±—É —Ç–≤–æ—é –º–∞—Ç—å –Ω–µ —Ç–æ–ª—å–∫–æ —è –Ω–µ—Ö—É–π –Ω–∞ –º–µ–Ω—è –±—ã—á–∏—Ç—å',
'—Ç–≤–æ—è –º–∞—Ç—å –∫–æ–≥–¥–∞ —á—Ç–æ –Ω–∏–±—É–¥—å –≥–æ—Ç–æ–≤–∏—Ç –Ω–µ –æ–±—Ö–æ–¥–∏—Ç—å—Å—è –±–µ–∑ –º–∏–Ω—å–µ—Ç–∞ –≤–µ–¥—å —ç—Ç–∞ —à–∫—É—Ä–∞ –ª—é–±–∏—Ç –æ—Ç—Å–∞—Å—ã–≤–∞—Ç—å –≤–æ –≤—Ä–µ–º—è –≥–æ—Ç–æ–≤–∫–∏ –æ—Ö—É–µ—à—å –º–∞–ª—ã–π',
'—è –±–ª—è –Ω–µ –∑–Ω–∞—é –º–æ–∂–µ—Ç –∏ —è —Ç–≤–æ–π –æ—Ç–µ—Ü —Ç—ã —ç—Ç–æ –Ω–µ —Ä–∞—Å—Ç—Ä–∞–µ–≤–∞–π—Å—è —Ö—É–π –∑–Ω–∞–µ—Ç —Ç–≤–æ—é –º–∞—Ç—å –¥–æ—Ö—É—è –∫—Ç–æ –µ–±–∞–ª',
'–¥–∞–≤–∞–π –ø–æ–∏–≥—Ä–∞–µ–º –≤ –∫–∞—Ä—Ç—ã –Ω–∞ —Ç–≤–æ—é –º–∞—Ç—å –¥–∞–∂–µ –µ—Å–ª–∏ —è –ø—Ä–æ–∏–≥—Ä–∞—é —Ç—ã –∂–µ –ø–æ–Ω–∏–º–∞–µ—à—å —á—Ç–æ –æ–Ω–∞ –≤—Å–µ —Ä–∞–≤–Ω–æ –º–æ—è',
'–¥–∞ –≥–æ–≤–æ—Ä—é —Ç–µ–±–µ –Ω–µ –¥–∞–º —è —Ç–µ–±–µ –¥–¥ –∑–∞ —Ç–≤–æ—é –º–∞—Ç—å –µ—ë –∫—Ç–æ —Ç–æ–ª—å–∫–æ –Ω–µ –µ–±–∞–ª –Ω–∞—à—ë–ª —Ä–µ–ª–∏–∫–≤–∏—é –±–ª—è—Ç—å',
'–¥–∞–≤–∞–π —è —Ç–≤–æ—é –º–∞—Ç—å —Ç—É—Ç –∑–∞—Ç—Ä–∞—Ö–∞—é –¥–æ —Å–º–µ—Ä—Ç–∏ –∏–ª–∏ —Ç—ã —á—ë —Ç—é—Ñ—è–∫ –¥–∞–∂–µ —Å–æ–ø—Ä–æ—Ç–∏–≤–ª—è—Ç—Å—å—è –Ω–µ –±—É–¥–µ—à—å –Ω—É –∑–∞ —ç—Ç–æ –ø—Ä–∏–¥—ë—Ç—Å—å—è —Ç–µ–±—è –ø—Ä–æ–≥–∏–±–æ–º —à–≤—ã—Ä–Ω—É—Ç—å',
'—è —Ç–µ–±–µ —Å–µ–π—á–∞—Å –≤–Ω–∞—Ç—É—Ä–µ —è–π—Ü–∞ –≤ —Ä–æ—Ç –∑–∞—Å—É–Ω—É –∏ —Ç—ã –∏—Ö –±—É–¥—å –ø–æ–ª–æ—Å–∫–∞—Ç—å –¥–æ –∫–æ–Ω—Ü–∞ —Å–≤–æ–∏—Ö –¥–Ω–µ–π —É—ë–æ–∫ –ø–æ—à—ë–ª –Ω–∞—Ö—É–π –æ—Ç —Å—é–¥–∞ –ø–æ–Ω—è–ª',
'–≤–æ—Ç –µ—Å–ª–∏ –±—ã —Ç—ã –ø—Ä–æ—è–≤–∏–ª —Ö–æ—Ç—è –±—ã –∫–∞–ø–ª—é —É–≤–∞–∂–µ–Ω–∏—è —è –±—ã –Ω–µ –µ–±–∞–ª —Ç–≤–æ—é –º–∞—Ç—å –∞ —Ç–∞–∫ –Ω–∞ —Å–∫–æ—Ä—É—é —Ä—É–∫—É —Å–µ–π—á–∞—Å —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –¥—É–ø–ª–æ –ø–æ—Ä–≤—É',
'—è —Ç–µ–±–µ —Ö—É–µ–º —Å–µ–π—á–∞—Å –ø—Ä–æ—Å—Ç—Ä–µ–ª—é —á–º–æ—à–Ω–∏–∫ —è —Ç–µ –≤–Ω–∞—Ç—É—Ä–µ —Å–µ–π—á–∞—Å –∫–∞—Ä—Ç–µ—á—å –≤ —Ç–≤–æ–π –∂–∏–≤–æ—Ç –Ω–∞—Ö—É—è—á—É —Ç—ã –¥—ã—Ä–∫–∞ –µ–±–∞–Ω–∞—è —É–ø–æ–ª–∑–∞–π —Å –∫—Ñ –ø–æ–∫–∞ –≤–æ–∑–º–æ–∂–Ω–æ—Å—Ç—å –µ—Å—Ç—å',
'—è —Ç–≤–æ—é –º—Ç–∞—å –Ω–∞ –ø–æ–ø—É—Ç–∫–∞—Ö –µ–±–∞–ª –æ–Ω–∞ –ø—ã—Ç–∞–ª–∞—Å—å –≤ –º–∞—à–∏–Ω—É –ø—Ä—ã–≥–Ω—É—Ç—å –Ω—É —è —Ö–µ–ª—É –∫–∞–∫ —á–ª–µ–Ω –µ–π –≤ —Ä–æ—Ç –∑–∞—Å—É–Ω—É–ª —Ç–∞–∫ —Å–∫–∞–∑–∞—Ç—å –ø—Ä–æ–∫–∞—Ç–∏–ª –±–ª—è—Ç—å',
'–µ—Å–ª–∏ —Ç–≤–æ—è –º–∞—Ç—å –≤ —Ç–µ—á–µ–Ω–∏–µ 5 —Å–µ–∫—É–Ω–¥ –Ω–µ –æ–ø—Ä–∞–≤–¥–∞–µ—Ç —Å–µ–±—è –Ω–∞ —Å—á—ë—Ç —Ç–æ–π —Ç–µ–º—ã —á—Ç–æ –æ–Ω–∞ –Ω–∞ —Ä–∞–π–æ–Ω–µ —à–∞–ª–∞–≤–∞ —è –µ—ë –≤—ã–µ–±—É –ª–æ–ª —ç—Ç–æ —Ä–æ—Ñ–ª —è –µ—ë –∏ —Ç–∞–∫ –≤—ã–µ–±—É',
'—Ç—ã –µ–±–∞–Ω–Ω—ã–π –∑–∞—à–∫–≤–∞—Ä–Ω—ã–π —É—Ç—ë–Ω–æ–∫ —è —Å–µ–π—á–∞—Å –ø—Ä–æ—Å—Ç–æ –≤–æ–∑—å–º—É –∏ —Å —Ä–∞–∑–≥–æ–Ω–∞ –≤—ã—à–∏–±—É –º–æ–∑–≥–∏ —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –ø–æ—Å–ª–µ —ç—Ç–æ–≥–æ –Ω–µ —Ñ–∞–∫—Ç —á—Ç–æ –æ–Ω–∞ –æ–∫–ª–∏–º–∞–µ—Ç—å—Å—è',
'–º—ã –∫–æ–≥–¥–∞ —Å –¥—Ä—É–∑—å—è–º–∏ –µ–∑–¥–∏–ª–∏ –Ω–∞ –æ—Ö–æ—Ç—É –æ–±–µ–∑–∞—Ç–µ–ª—å–Ω–æ –±—Ä–∞–ª–∏ —Ç–≤–æ—é –º–∞—Ç—å —Ç—ã –ø–æ—É–¥–º–∞–µ—à—å –æ–Ω–∞ –µ–±—É—á–∏ –æ—Ö–æ—Ç–∏—Ç—å—Å—è –Ω–µ –ø—Ä–æ—Å—Ç–æ —à–∞–ª–∞–≤–∞ –Ω–∞ –æ—Ö–æ—Ç–µ –Ω–µ –ø–æ–º–µ—à–∞–µ—Ç',
'–≤ —Ä—É–∫–∞—Ö –∞–≤—Ç–æ–º–∞—Ç –ø–æ—Ç–æ–º—É —á—Ç–æ —Å–æ–ª–¥–∞—Ç –µ–±–∞–ª —Ç–≤–æ—é –º–∞—Ç—å  –∏ –µ–±—É –ø–æ—Ç–æ–º—É —á—Ç–æ –≤—ã–π–≥—Ä–∞–ª –≤–æ–π–Ω—É —è–π—Ü–∞ –≥–ª–æ—Ç–∞–π –∑–∞ –æ—Ç—á–∏–∑–Ω—É —Å—Ç—Ä–µ–ª—è–π',
'—Ç–≤–æ—è –º–∞—Ç—å –∫–∞–∫ –ø–æ—Ç–µ—Ä–µ–Ω–Ω—ã–π –º–∞–º–æ–Ω—Ç—ë–Ω–æ–∫ –≤–æ–±—â–µ –Ω–µ –æ—Ä–µ–Ω—Ç–∏—Ä—É–µ—Ç—å—Å—è –≤ –ø—Ä–æ—Å—Ç—Ä–∞—Å–Ω—Ç–≤–µ —è –µ–π –≥–æ–≤–æ—Ä—é —á—Ç–æ —è –µ—ë –≤—ã–µ–±—É –æ–Ω–∞ –Ω–µ —à–∞—Ä–∏—Ç –∏ –ø—ã—Ç–∞–µ—Ç—å—Å—è —É–µ—Ö–∞—Ç—å –∫ –º–∞–º–µ',
'—è —Ç–≤–æ–µ–π –º–∞–º—ã –º–∞–º—É –µ–±–∞–ª —Ç—ã –ø–æ–Ω–∏–º–∞–µ—à—å —á—Ç–æ –Ω–∞—à–∏ —É–∑—ã —Ç—è—Å–Ω–æ —Å–≤—è–∑–∞–Ω–Ω—ã –º–µ–∂–¥—É —Å–æ–±–æ–π –≤–∞—Ñ–µ–ª –µ–±–∞–Ω–Ω—ã–π',
'–∑–∞ –¥—Ä—É–∑–µ–π –∏ –¥–≤–æ—Ä —Å—Ç—Ä–µ–ª—è—é –≤ —É–ø–æ—Ä —Ç–∞–∫ –≥–æ–≤–æ—Ä–∏–ª–∞ —Ç–≤–æ—è –º–∞—Ç—å –ø–æ–∫–∞ —è –µ–π —Ö—É–µ–º –Ω–∞ –ª–±—É –Ω–µ –≤—ã–∂–∏–≥ –∫–ª–µ–π–º–æ –µ–±–∞–Ω–Ω–æ–π —à–ª—é—Ö–∏',
'—è —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –Ω–∞ –æ–±–µ–¥ —Ö—É–π –≤ —Ä—ã–ª–æ –∑–∞–≤–æ—Ä–∞—á–∏–≤–∞—é –∏–∑–≤–∏–Ω–∏ –∑–∞ —Ç–∞–∫–æ–π –≤–æ–ø—Ä–æ—Å —Ç—ã –≤—ã–±–ª—è–¥–æ–∫ –Ω–æ—Ä–º–∞–ª—å–Ω–æ –∫ —ç—Ç–æ–º—É –æ—Ç–Ω–æ—Å–∏—à—å—Å—è –µ—Å–ª–∏ –Ω–µ—Ç —Ç–æ –º–æ–≥—É –∑–∞–≤–æ—Ä–∞—á–∏–≤–∞—Ç—å –Ω–∞ —É–∂–∏–Ω',
'–ø–æ —Ç–∞–∫–æ–π —Å—Ö–µ–º–µ —è –º–æ–≥—É —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞—Ç—å —Ä–∞–∑ 40 –Ω–æ –º–æ—è —Å—Ö–µ–º–∞ –µ—â—ë –Ω–µ —Å–æ–≤–µ—Ä—à–µ–Ω–Ω–∞ —Ç–∞–∫ —á—Ç–æ —Ç–≤–æ—é –º–∞—Ç—å —à–∞–ª–∞–≤—É –ø–æ–∫–∞ –Ω–∞ —Ä–∞—Å–ª–æ–±–æ–Ω–µ –µ–±—É',
