'–Ø —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –≤ –≥–ª–æ—Ç–∫—É –µ–µ –µ–±–∞–Ω—É—é –∏ —Å–ª—É—á–∞–π–Ω–æ –ø—Ä–æ–±–∏–ª —Å–≤–æ–∏–º —Ö—É–µ–º –µ–µ —â–µ–∫—É –µ–±–ª–∏–≤—É—é —Å—É–∫–∞ –ø–∏–¥–æ—Ä–∞—Å–∞ —Ç—ã –∫—É—Å–æ–∫ –Ω–∞—Ö—É–π, —è –∂–µ –±–ª—è—Ç—å –≤ –Ω–∞—Ç—É—Ä–µ —Ç–µ–±–µ –±–∞–∑–∞—Ä—ã —á—Ç–æ –º–∞—Ç—å —Ç–≤–æ—è —Ñ–ø–Ω–∞—Ç–µ–µ –æ—Ç –º–æ–µ–≥–æ —Ö—É—è –∏ –æ–Ω–∞ –±—É–¥–µ—Ç —Å–æ—Å–∞—Ç—å –µ–≥–æ –≤—Å–µ–≥–¥–∞',
