'–¢—ã –±–ª—è—Ç—å –ø–ª–µ—à–∏–≤—ã–π —Ö—É–µ—Å–æ—Å —Å—É–∫–∞ –∏ —è –ø—Ä–æ—Å—Ç–æ –±—É–¥—É –∫–æ—Ä–º–∏—Ç—å —Ç–µ–±—è —Å–≤–æ–µ–π —Å–ø–µ—Ä–º–æ–π –∫–∞–∂–¥—ã–π –¥–µ–Ω—å –Ω–∞—Ö—É–π —á—Ç–æ–±—ã –ø–æ–¥–¥–µ—Ä–∂–∏–≤–∞—Ç—å —Ä–µ–≥—É–ª—è—Ä–Ω—ã–π —Ç–æ–Ω—É—Å –≤ —Ç–≤–æ—ë–º –æ—Ä–≥–∞–Ω–∏–∑–º–µ –ü–∞–∂–æ–ª—å —Ç—ã –µ–±–∞–Ω–∞—è –ø–æ–Ω–∏–º–∞–µ—à—å —á—Ç–æ –º–∞—Ç—å —Ç–≤–æ—è —à–ª—é—Ö—É –º–æ—è –ª–∏—á–Ω–∞—è —Ç —Ç–≤–æ—è –º–∞—Ç—å –±—É–¥–µ—Ç –¥–æ –∫–æ–Ω—Ü–∞ —Ç–≤–æ–µ–π –∂–∏–∑–Ω–∏ —Å–æ—Å–∞—Ç—å –º–æ–π —Ö—É–π',
'–¢—ã –±–ª—è—Ç—å –∑–µ–±—Ä–∞ –µ–±–∞–Ω–∞—è —Å—É–∫–∞ —è –ø—Ä–æ—Å—Ç–æ –µ–±–∞—à–∏–ª –ø–æ–ª–æ—Å–∫–∏ –Ω–∞ —Ç–≤–æ—ë–º —Ç–µ–ª–µ —Å–≤–æ–∏–º —Ö—É–µ–º –≥—É–¥—Ä–æ–Ω–æ–º –ø–∞–ª–∫–∞ —Ç—ã –µ–±–∞–Ω–∞—è –ø–æ—à—ë–ª –Ω–∞—Ö—É–π –æ—Ç—Å—é–¥–∞ —Å—à–∏—Ç—ã–π –ø–∏–¥–æ—Ä —Å –ø–∏–∑–¥–æ–π —Å–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ —à–µ–ª–∫–æ–≤—ã–º–∏ –Ω–∏—Ç–∫–∞–º–∏ –µ–±–∞—Ç—å –∏–Ω–∞—á–µ —è –Ω–∞—Ö—É–π —Ä–ø–∑–¥–µ–ø–ª—é –≤–∞—Å –∏ —Ç—ã –Ω–∞–≤—Å–µ–≥–¥–∞ –∑–∞–±—É–¥–µ—à–ª –∑–∞–ø–∞—Ö –ø–∏–∑–¥—ã —Ä–æ–¥–Ω–æ–π —à–∞–ø–æ–∫–ª—è–∫ —Ç—ã –µ–±–∞–Ω—ã–π —Å—É–∫–∞, –∫–∞—Ä–∫–∞–ª—ã–≥–∞ —Ç—ã –µ–±–ª–∏–≤–∞—á —è –ø—Ä–æ—Å—Ç–æ –≤—ã–µ–±—É —Ç–µ–±—è —Ç—É—Ç –ø–æ–Ω–∏–º–∞–µ—à—å',
'–°–ª—ã—à—å –±–ª—è—Ç—å –æ–ª–µ–Ω—å –µ–±–∞–Ω—ã–π? –Ø –≤ –Ω–∞—Ç—É—Ä–µ —Ç–≤–æ—é –ø–∏–∑–¥—É —Ä–∞—Å—Ç—è–Ω—É –ø–æ —Å–≤–æ–µ–π –∑–∞–ª—É–ø–µ –∫–∞–∫ –ø–æ–∫—Ä—ã–≤–∞–ª–æ –µ–±–∞–Ω–æ–µ –µ–±–∞–Ω—ã–π —Ç—ã —Å—É–∫–∞ –≤—ã–±–ª—è–¥–æ–∫ –Ω–∞—Ö—É–π, —è —É–∂–µ –±–ª—è—Ç—å –ø—Ä–æ—Å—Ç–æ –µ–±—É —Ç–≤–æ—é –º–∞—Ç—å –∏ –µ–π –æ—Ç —ç—Ç–æ–≥–æ —Å—Ç–∞–Ω–æ–≤–∏—Ç—Å—è —Ö–æ—Ä–æ—à–æ –ø–æ–Ω–∏–º–∞–µ—à—å –µ–±–∞–Ω–∞—è —Ç—ã —Å—É–∫–∞ –∫–æ–ª—ã–º–∞–≥–∞ –±–ª—è—Ç—å?',
'–¢—ã –ø–æ–Ω–∏–º–∞–µ—à—å —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å –±–ª—è—Ç—å —Ç—É–ø–æ—Ä–æ–≥–∞—è —à–∞–ª–∞–≤–∞ –∏ —Ç–µ–±–µ –Ω—É–∂–Ω–æ –≤—ã–≤–æ–¥–∏—Ç—å –µ–µ –≤ –ø–æ–ª–µ —á—Ç–æ–±—ã –≤—ã–≥—É–ª–∏–≤–∞—Ç—å –∫–∞–∫ –∫–æ—Ä–æ–≤—É –µ–±–∞–Ω—É—é –ø–æ–Ω–∏–º–∞–µ—à—å –æ —á–µ–º —è —Ç–µ–±–µ —Å–µ–π—á–∞—Å —Ç—É—Ç —Ä–∞—Å—Å–∫–∞–∑—ã–≤–∞—é—Ç —Ç—É–ø–æ–π –±—ã –±–ª—è—Ç—å –ø–∏–¥–æ—Ä–∞—Å, –º–Ω–µ —á–µ –æ–ø—è—Ç—å —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞—Ç—å –Ω–∞—á–∞—Ç—å —á—Ç–æ –ª–∏ —è –ø–æ–Ω—è—Ç—å –Ω–µ –º–æ–≥—É –∫—Ä—ã—Å–∞ –µ–±–∞–Ω–∞—è –±–ª—è—Ç—å —è –≤ –Ω–∞—Ç—É—Ä–µ –º–∞—Ç—å —Ç–≤–æ—é –±—É–¥—É —Ö—É–µ–º —Ö—É—è—Ä–∏—Ç—å –∫–∞–∫ –≥—Ä—É—à—É –±–æ–∫—Å–µ—Ä—Å–∫—É—é –Ω–∞—Ö—É–π',
'–¢—ã –±–ª—è—Ç—å –∫–æ—Å—Ç—ã–ª—å –µ–±–∞–Ω—ã–π –ø–æ—à—ë–ª –Ω–∞—Ö—É–π –æ—Ç –ø–∏–∑–¥—ã —Å–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –∏ –¥–∞–∂–µ –Ω–µ —Å–ø–µ—Ü —Ç—Ä–æ–≥–∞—Ç—å –µ–µ —è–∑—ã–∫–æ–º –∏–±–æ –æ–Ω–∞ –ø—Ä–µ–Ω–∞–¥–ª–µ–∂–∏—Ç —Ç–æ–ª—å–∫–æ –º–Ω–µ –∏ –Ω–∏–∫–æ–º—É –±–æ–ª—å—à–µ –ø–æ—ç—Ç–æ–º—É —Å—ä–µ–±–∞–ª—Å—è –Ω–∞—Ö—É–π –∏–∑ –º–æ–µ–≥–æ –ø–æ–ª—è –∑—Ä–µ–Ω–∏—è –ø–æ–∫–∞ —è —Ç–µ–±–µ –∫–æ–Ω—Ç—É–∑–∏—é –Ω–µ –æ–±–µ—Å–ø–µ—á–∏–ª –µ–±–∞—Ç—å –ø—Ä–æ—Å—Ç–æ—Ñ–∏–ª—è —Ç—ã —Ç—É–ø–æ—Ä—ã–ª–∞—è',
'–Ø —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –∏ —ç—Ç–∞ —à–ª—é—Ö–∞ –ø–æ–ª–∏—Ä–æ–≤–∞–ª–∞ –º–æ–π —Ö—É–π —Å–≤–æ–µ–π –ø–∏–∑–¥–æ–π –µ–±–∞–Ω–æ–π –ø–æ—Ç–æ–º —Å–æ—Å–∞–ª–∞ –º–æ—é –∑–∞–ª—É–ø—É –∫–∞–∫ –ø–æ—Å–ª–µ–¥–Ω—è—è —à–ª—é—Ö–∞ –∏ –º–Ω–µ –ø—Ä–∏—à–ª–æ—Å—å –æ—Ç–ª–µ–ø–ª—è—Ç—å —è–∑—ã–∫ —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –æ—Ç –º–æ–µ–≥–æ —Ö—É—è –∏–±–æ –æ–Ω–∞ –ø—Ä–∏—Å–æ—Å–∞–ª–∞—Å—å —Å–ª–∏—à–∫–æ–º —Å–∏–ª—å–Ω–æ —Å–ª–æ–≤–Ω–æ –æ–Ω–∞ –Ω–∞ —è–∑—ã–∫ –∫–∞–ø–Ω—É–ª–∞ –∫–ª–µ–π –Ω–∞—á–∞–ª–∞ –ª–∏–∑–∞—Ç—å –º–Ω–µ —Ö—É–π',
'–¢—ã –±–ª—è—Ç—å –µ–ª–æ–≤—ã–π —Ö—É–µ—Å–æ—Å –ø–æ—à—ë–ª –Ω–∞—Ö—É–π —Å –º–æ–µ–≥–æ —Ö—É—è –ø–æ–∫–∞ —è —Ç–µ–±–µ –µ–±–ª–æ –Ω–µ —Å–ª–æ–º–∞–ª –Ω–∞—Ö—É–π –∏ –≤–æ–æ–±—â–µ –Ω–µ —Å–º–æ—Ç—Ä–∏ –Ω–∞ –º–æ–π —Ö—É—Ü –æ–±—Ö–æ–¥–∏ –µ–≥–æ —Å—Ç–æ—Ä–æ–Ω–æ–π –µ–±–∞–Ω—ã–π —Ç—ã –ø–∏–¥–æ—Ä –∏–Ω–∞—á–µ —è –±—É–¥—É –≤—ã–Ω—É–∂–¥–µ–Ω –µ–±–∞—à–∏—Ç—å —Ç–µ–±—è –∏–º –∫–∞–∂–¥—ã–π –¥–µ–Ω—å –ø–æ —Ç–≤–æ–µ–π —Ç—É–ø–æ–π –≥–æ–ª–æ–≤–µ —Å—É–∫–∞ –µ–±–∞–Ω–∞—è –±—ã –¥—É—Ä–æ—á–∫–∞ –±–ª—è—Ç—å',
'–¢—ã —Å—É–∫–∞ –≤ –∫—É—Ä—Å–µ —á—Ç–æ –º–æ–π —Ö—É–π –±—ã–ª –ø—Ä–∏–∑–Ω–∞–Ω –ª—É—á—à–∏–º –µ–±–∞—Ä–µ–º —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ —à–∞–ª–∞–≤—ã –∏ —Ç–µ–±–µ —Å–ª–µ–¥—É–µ—Ç –ø—Ä–æ—è–≤–ª—è—Ç—å —É–≤–∞–∂–µ–Ω–∏–µ –∫ –º–æ–µ–º—É —Ö—É—é –∏–Ω–∞—á–µ –æ–Ω –ø—Ä–æ—Å–æ –Ω–∞—á–Ω—ë—Ç –∏ —Ç–µ–±—è –µ–±–∞—Ç—å –ø–æ–∫–∞ —Ç—ã –Ω–µ –Ω–∞–Ω–µ—à—å –Ω—ã—Ç—å—å –∫–∞–∫ –¥—É—Ä–Ω–∞—è —à–ª—é—Ö–∞',
'–¢–≤–æ—è –º–∞—Ç—å –µ–±–∞–Ω–∞—è –∫–æ—Ä–≥–∞ –∏ —è –ø—Ä–æ—Å—Ç–æ —Å–≤–æ–∏–º —Ö—É–µ–º –µ–π —Ö—Ä–µ–±–µ—Ç —Å–ª–æ–º–∞—é –Ω–∞—Ö—É–π —á—Ç–æ–±—ã —ç—Ç–∞ —Ç–≤–∞—Ä—å –µ–±–∞–Ω–∞—è –ø–µ—Ä–µ—Å—Ç–∞–ª–∞ —Å–≤–æ–±–æ–¥–Ω–æ –ø–µ—Ä–µ–¥–≤–∏–≥–∞—Ç—å—Å—è –∏ –ª–µ–∂–∞–ª–∞ –≤ –ø–∞–º–ø–µ—Ä—Å–∞—Ö –∫–æ—Ç–æ—Ä—ã–µ —Ç—ã –µ–π –±—É–¥–µ—à—å –º–µ–Ω—è—Ç—å, —É—Ä–æ–¥ —Å—É–∫–∞ –µ–±–∞–Ω—ã–π',
'–¢—ã –ø–æ–Ω–∏–º–∞–µ—à—å —á—Ç–æ –º–æ–π —Ö—É–π –≤ –ø–∏–∑–¥–µ —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –±—É–¥–µ—Ç –ø—Ä–æ–∂–∏–≤–∞—Ç—å –Ω–∞ –∑–∞–∫–æ–Ω–Ω—ã—Ö –æ—Å–Ω–æ–≤–∞–Ω–∏—è—Ö –∏ –ø–æ—ç—Ç–æ–º—É –≤—Å–µ –ø–æ–ø—ã—Ç–∫–∏ –≤—ã—Å–µ–ª–µ–Ω–∏—è –µ–≥–æ –±—É–¥—É—Ç –æ–±–∂–∞–ª–æ–≤–∞–Ω—ã —Å –∏—Å–∫–æ–≤ –≤ —Å—É–¥ –∏ –≤–æ–∑–º–æ–∂–Ω–æ —á—Ç–æ –ø–∏–∑–¥—É —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –≤–æ–≤—Å–µ –æ–ø–µ—á–∞—Ç–∞—é—Ç',
'–ö–æ—Ä–æ—á–µ —è –≤ –ø–∏–∑–¥—É —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –ø—Ä–æ–≤—ë–ª —ç–ª–µ–∫—Ç—Ä–∏—á–µ—Å—Ç–≤–æ –∏ –≤–æ—Ç –¥—É–º–∞—é —É—Å—Ç–∞–Ω–æ–≤–∏—Ç—å —Ç–∞–º –ø–ª–∞–∑–º—É –∏ –º–Ω–æ–≥–∏–µ –¥—Ä—É–≥–∏–µ —É–¥–æ–±—Å—Ç–≤–∞ –¥–ª—è –º–æ–µ–≥–æ —Ö–æ—Ä–æ—à–µ–≥–æ —Ö—É—è –ø–æ—ç—Ç–æ–º—É —Ç–µ–±–µ –Ω—É–∂–Ω–æ –±—É–¥–µ—Ç —Å–¥–µ–ª–∞—Ç—å —Ç–∞–º –∫–æ—Å–º–µ—Ç–∏—á–µ—Å–∫–∏–π —Ä–µ–º–æ–Ω—Ç –≤–Ω—É—Ç—Ä–∏ —á—Ç–æ–±—ã –º–æ–µ–π –∑–∞–ª—É–ø–µ –±—ã–ª–æ –ø—Ä–∏—è—Ç–Ω–æ–≥–æ —Ç–∞–º –Ω–∞—Ö–æ–¥–∏—Ç—Å—è',
'–¢—ã –±–ª—è—Ç—å –≥–∞–ª–æ—à–∞ –µ–±–∞–Ω–∞—è —è —Ç–µ–±—è –≤ –Ω–∞—Ç—É—Ä–µ —Ö—É–µ–º —Å–≤–æ–∏–º —Ä–∞–∑–≤–∞–ª—é –Ω–∞—Ö—É–π –ø–æ –∑–∞–ø—á–∞—Å—Ç—è–º–∏ –µ–±–∞—Ç—å –∏ –≤—Å—è —Ç–≤–æ—è —Å–µ–º—å—è –¥–æ–ª–∂–Ω–∞ –±—É–¥–µ—Ç —Å–∏–¥–µ—Ç—å –∏ —Å–æ–±–∏—Ä–∞—Ç—å —Ç–µ–±—è –ø–æ –∫—É—Å–æ—á–∫–∞–º',
'–¢—ã –±–ª—è—Ç—å —à–∞–∫–∞–ª –µ–±–∞–Ω—ã–π —Ç—ã –ø–æ–Ω–∏–º–∞–µ—à—å —á—Ç–æ —è —Ç–≤–æ—é –º–∞—Ç—å –±—É–¥—É —Ö—É–µ–º –∑–∞–≥–æ–Ω—è—Ç—å –ø–æ–¥ —Å–≤–æ—é –∫—Ä–æ–≤–∞—Ç—å —à–ª—é—Ö—É —ç—Ç—É –ø–æ–¥—à–∫–æ–Ω–∞—á–Ω—É—é –∞ —Ç–µ–±—è —è –±—É–¥—É –ø—Ä–æ—Å—Ç–æ –ø–∏–∑–¥–∏—Ç—å —Å–≤–æ–∏–º —Ö—É–µ–º –∫–∞–∫ –µ–±–∞–Ω–æ–≥–æ –•—É–µ—Å–æ—Å–∞ –∏ –º–Ω–µ –ø–æ—Ö—É—Ü –Ω–∞ —Ç–µ–±—è –µ–±–∞–Ω–≥–æ–≥–æ –ø–µ—Ç—É—Ö–∞ —è –≤—Å–µ —Ä–∞–≤–Ω–æ —Ä–∞–∑–Ω–µ—Å—É —Ç–≤–æ—ë –µ–±–∞–ª–æ',
'–°–ª—ã—à—å –µ–±–∞—Ç—å –ø—É–¥–µ–ª–∏—Ö–∞ –µ–±–∞–Ω–∞—è? –¢—ã –ø–æ–Ω–∏–º–∞–µ—à—å —á—Ç–æ –º–æ–π —Ö—É—Ü –≤ –ø–∏–∑–¥–µ —Ç–≤–æ–µ–π —Å—Ç—ë—Ä—Ç –ø–æ—Å–µ–ª–∏–ª—Å—è –∫–∞–∫ –≤ –∫–≤–∞—Ä—Ç–∏—Ä—É –Ω–∞ –¥–æ–ª–≥–æ–µ –≤—Ä–µ–º—è –∏ –æ–ø–ª–∞—á–∏–≤–∞–µ—Ç –æ–Ω —ç—Ç–æ —Å–≤–æ–µ–π —Å–ø–µ—Ä–º–æ–π –≤ —Ä–∞–∑–º–µ—Ä–µ –Ω–µ—Å–∫–æ–ª—å–∫–∏—Ö –±–∞–Ω–æ–∫ —á—Ç–æ–±—ã –ø–æ—à–Ω–≥–æ—Å—Ç—å—é –∫–æ—Ä–º–∏—Ç—å —Å–µ–º—å—é —Ç–≤–æ—é –µ–±–∞–Ω—É—é',
