'–±–ª—è—è—è —è —Ç—É—Ç –ø–æ–Ω—è–ª –∑–∞—á–µ–º —Ç–µ–±—è –µ–±–∞—Ç—å –≤–æ—Ç —Å–º–æ—Ç—Ä–∏ –ø–æ–º–Ω–∏—à—å –∫–∞–∫ —Ç—ã –º–Ω–µ –∑–∞ —Å–≤–æ–π –æ—Ç—Å–æ—Å –Ω–µ –ø–ª–∞—Ç–∏–ª? —Ç—ã –ø—ã—Ç–∞–ª—Å—è –º–Ω–µ —Å–¥–µ–ª–∞—Ç—å –æ—Ç—Å–æ—Å –∑–∞ –∫—Ä–µ–¥–∏—Ç? –ø–æ–Ω–∏–º–∞–µ—à—å? –±–±–ª—è —Ç—ã —Ä–∏–ª–∏ –¥—É–º–∞–µ—à—å –≤—ã–≤–µ–∑–µ—à—å –º–µ–Ω—è? —Ö—É–µ—Å–∞—Å —Ç—ã –µ–±–∞–Ω—ã–π –ø–∏–¥–æ—Ä–∞—Å',
'—Å–ª—ã—à–∏—à—å —Ç—ã –ø–æ–Ω–∏–º–∞–µ—à—å –∫–∞–∫ —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª–∏ —Å—Ç–∏–ª–µ–º –∂—É—Ä–∞–≤–ª—è? –ø–æ–º–Ω–∏—à—å –∫–∞–∫ –æ–Ω–∞ —Å—Ç–∞–Ω–∞–ª–∞ –Ω–∞—Ö—É–π —Å—É–≤–∞–ª–∞ —Å–≤–æ—é –≥–æ–ª–æ–≤—É –≤ –∑–µ–º–ª—é –µ–±–∞—Ç—å —è —Ç–æ–≥–¥–∞ –æ—Ä–∞–ª —É—Ö—Ö—Ö–∞ –∫–∞–∫ —à–∞—Å –Ω–∞–¥ —Ç–æ–±–æ–π –∫–∞–∫ —Ä–≤—É—Ç —Ç–µ–±–µ —â–µ–∫—É –º–æ–∏–º —Ö—É–µ–º',
'–±–ª—è—Ç—å —Ç—ã —á–µ –Ω–∞–∑—É–π –Ω–∞—Ö—É–π –∞—Ö—É–µ–ª–∞ –ø–∏–∑–¥–∞–ª–∏–∑–∫–∞ –µ–±–∞–Ω–∞—è —Ç–µ–±—è —á—Ç–æ –Ω–∞—Ö—É–π –µ–±–∞—Ç—å –µ–∞–∫ —à–ª—é—Ö—É –¥—Ä–∞–Ω—É–± –∏–ª–∏ —á—Ç–æ –ø–∏–¥–æ—Ä–∞—Å –µ–±–∞–Ω—ã–π –¥–∞ —è/—Ç–µ–±—è –µ–±–∞—Ç—å –∫–∞–∫ —à–ª—é—Ö—É –±—É–¥—É –ø–∏–¥–æ—Ä–∞—Å —Ç—ã –µ—å–∞–Ω—ã–π –Ω–∞–∑—É–π –ø–æ—à–µ–ª –ø–µ—Ç—É—Ö –¥—Ä–∞–Ω–Ω—ã–π —è –∂–µ –Ω–∞—Ö—É–π –µ–±–∞—Ç—å —Ç–µ–±—è –±—É–¥—É –ø–æ–º–Ω–∏—à—å –∫–∞–∫ —Ç–≤–æ—è –º–∞—Ç—å –Ω–∞—á–∞–ª–∞ —Å–æ—Å–∞—Ç—å –º–Ω–µ —Ö—É–π –∏ –ø–æ–±–µ–∂–∞–ª–∞ –≤ —Ç—É–∞–ª–µ—Ç –≤–æ –≤—Ä–µ–º—è –∫–æ–≥–¥–∞ —É —Ç–µ–±—è –ø–æ–Ω–æ—Å–∏–ª –∏ —Ç—ã –Ω–∞—Å—Ä–∞–ª –Ω–∞ —Å–≤–æ—é –º–∞—Ç—å –∞ –æ–Ω–∞ –∑–∞ —ç—Ç–æ —Ç–µ–±—è –µ—Ä—à–∏–∫–æ–º –≤—ã–µ–±–∞–ª–∞ –ø–æ–º–Ω–∏—à—å —Ç—ã –∂–µ –Ω–∞—Ö—É–π –Ω–µ–∫—á–µ–º–Ω—ã–π –ø–∏–¥–æ—Ä–∞—Å —Ç–µ–±—è –º–∞–ª–æ –≤—ã–µ–±–∞—Ç—å –∏ —Ç—ã –µ—â—ë –ø—ã—Ç–∞–µ—à—å—Å—è —á—Ç–æ —Ç–æ –ø–∏—Å–∞—Ç—å —Ö—É–µ—Å–∞—Å —Ç—ã –µ–±–∞–Ω—ã–π )–ø–æ–º–Ω–∏—à—å –∫–∞–∫ —É—á–µ–Ω—ã–µ –Ω–∞—à–ª–∏ –≤ –ø–∏–∑–¥–µ —Ç–≤–æ–µ–π –º–∞–º–∫–º –∫–æ—Å—Ç—å –¥–∏–Ω–æ–∑–∞–≤—Ä–∞? —Ç—ã –Ω–∞—Ö—É–π –º–æ–µ–≥–æ—Ö—É—è –Ω–µ —Å—Ç–æ–∏—à—å –ø—Ä–∏—á–µ–º —Ç—É—Ç —Ç–≤–æ–π –æ—Ç—Å–æ—Å –µ–±–∞–Ω—ã–π —Ç—ã –∑—É–Ω—Å–∞–∞ —Ç—ã —É –º–µ–Ω—è –±–µ—Å–ø–ª–∞—Ç–Ω–æ —Å–ø–∞—Å–∞—Ç—å –¥–æ–ª–∂–µ–Ω –ø–æ–Ω–∏–º–∞–µ—à—å —Ö—É–µ—Å–∞—Å —Ç—ã –µ–±–∞–Ω—ã–π –≤ —Ä–æ—Ç —Ç—ã –±–ª—è—Ç—å –ø–µ—Ç—É—Ö –µ–±–∞–Ω—ã–π –ø–æ—à–µ–ª —è —Ç–µ–±–µ –≥–æ–≤–æ—Ä–± –Ω–∞ —Ö—É–π –ø–∏–¥–æ—Ä–∞—Å',
'—Å–ª—ã—à—å —Ç—ã –ø–∏–¥–æ—Ä–∞—Å —Ç—ã –º–µ–Ω—è –Ω–µ –∑–∞—Ç—Ä–æ–ª–∏—à—å –∏–±–æ —Ç—ã —Ö—É–π –º–Ω–µ —è–∑—ã–∫–æ–º –º–æ–∑–æ–ª–∏—à—å, —è –µ–±–∞–ª —Ç–µ–±—è –≤ —Ä–æ—Ç —Ç–∞–∫ —á—Ç–æ –∏–¥–∏ –Ω–∞—Ö—É–π –µ–±–∞–Ω—ã–π –≤ —Ä–æ—Ç) –µ–±–∞–ª–∏ —Ç–µ–±—è —á—É—Ä–∫–∏ —Ç—ã –µ—â—ë —Ö–æ—á–µ—à—å –º–Ω–µ —á—Ç–æ —Ç–æ –ø–∏–∑–¥–µ—Ç—å? —Ö—É–µ—Å–∞—Å —Ç—ã –µ–±–∞–Ω—ã–π',
'—Ç—ã —á–µ –µ–±–∞—Ç—å –∞—Ö—É–µ–ª–∞ –Ω–∞—Ö—É–π –ø–∏–¥–æ—Ä–∞—Å–∫–∞ –Ω–∞–∑—É–π —â–∞—Å –º–æ–π —Ö—É–π –≤—Å–∏–∞–Ω–µ—Ç –∞ —Ç—ã –ª—è–∂–µ—à—å –ø–æ–Ω–∏–º–∞–µ—à—å? —Ö—É–µ—Å–∞—Å –µ—å–∞–Ω—ã–π —Ç—ã –º–æ–π —Ö—É–π —Å–æ—Å–∞—Ç—å –±—É–¥–µ—à—å –∫–∞–∫ –Ω–∏–∫—Ç–æ –¥—Ä—É–≥–æ–π –ø–∏–¥–æ—Ä–∞—Å —Ç—ã –µ–±–∞–Ω—ã–π –±–ª—è—Ç—å –ø–µ—Ç—É—Ö —Å—É–∫–∞ –Ω–∞—Ö—É–π –∏–¥–∏ —è –Ω–∞—Ö—É–π –Ω–∞—á–Ω—É —Ç–µ–±—è –µ–±–∞—Ç—å –∏ –¥–∞–∂–µ –Ω–µ –ø–∏–∫–Ω—É',
'—à–ª—é—Ö–∞ –µ–±–∞—Ç—å –ø–∏—à–∏ –Ω–æ—Ä–º–∞–ª—å–Ω–æ —Ç—ã –¥–ª—è –º–æ–µ–≥–æ —Ö—É—è –ø–∏—à–µ—à—å –ø–æ–Ω–∏–º–∞–µ—à—å? –ø–∏–¥–æ—Ä–∞—Å –µ–±–∞–Ω—ã–π —Ç—ã –±–ª—è—Ç—å –Ω–∞ –º–æ–π —Ö—É–π –∞–≥—Ä —Å–≤–æ–π –Ω–µ –æ—Ç–ø—É—Å–∫–∞–π –µ–±–∞–Ω—ã–π –≤ —Ä–æ—Ç –ø–µ—Ç—É—Ö —Ç—ã –µ–±–∞–Ω—ã–π –µ–±–∞–ª–∏ —Ç–µ–±—è –ø—Å—ã –Ω–∞—Ö—É–π –ø–∏–¥–æ—Ä–∞—Å —Ç—ã –≥–∞–ª–∏–º—ã–π —Ö—É–µ—Å–∞—Å –µ–±–∞–Ω—ã–π –ø–µ—Ä–µ–≤–∞—Ä–∏–≤–∞–π –≤—Å–µ —á—Ç–æ —è –ø–∏—à—É –ø–∏–¥—Ä ??',
'—Å–ª—ã—à–∏—à—å —Ç—ã –∂–∏–≤–æ—Ç–Ω–æ–µ —Ç–µ–±—è —â–∞—Å –±–æ–≥–∞—Ç—ã—Ä—å –≤ –∂–æ–ø—É –¥—Ä–∞—Ç—å –±—É–¥–µ—Ç –ø–æ–Ω–∏–º–∞–µ—à—å? —Ö—É–µ—Å–∞—Å —Ç—ã –µ–±–∞–Ω—ã–π —è —Ç–µ–±—è –µ–±–∞—Ç—å –≤—ã–µ–±—É –∫–∞–∫ —à–ª—é—Ö—É —Å–ø–∏–¥–æ–∑–Ω—É—é –Ω–∞—Ö—É–π',
'–±–ª—è—Ç—å –µ–±–∞—Ç—å —Ç–µ–±—è –∑–∞ —â–µ–∫—É —Ç—ã —á—Ç–æ –Ω–∞—Ö—É–π –ø–µ—Ä–µ–¥–æ–º–Ω–æ–π —É–Ω–∏–∂–∞–µ—à—å—Å—è? –ø–∏–¥–æ—Ä–∞—Å –Ω–∞—Ö—É–π —Ç–µ–±—è —á—Ç–æ –≤—ã–µ–±–∞—Ç—å? —á—Ç–æ –ª–µ? —Ö—É–µ—Å–∞—Å?',
'—è –µ–±–∞—Ç—å –∫–æ–≥–¥–∞ –≤ –∑–µ—Ä–∫–∞–ª–æ —Å–º–æ—Ç—Ä—é –≤–∏–∂—É —Ç–≤–æ–µ –µ–±–∞–Ω–æ–µ –ª–∏—Ü–æ –≤ —Å–ø–µ—Ä–º–µ –ø–æ–Ω–∏–º–∞–µ—à—å? –ø–∏–¥–æ—Ä–∞—Å –µ–±–∞–Ω—ã–π? —è —Ç–µ–±—è –µ–±–∞—Ç—å –±—É–¥—É –∫–∞–∫ —à–ª—é—Ö—É –µ–±–∞–Ω—É—é ?? —Ç—ã –Ω–µ –ø–æ–Ω–∏–º–∞–µ—à—å –ø–æ—Ö–æ–¥?',
'–±–ª—è –µ–±–∞—Ç—å —Ç—ã –Ω–∞—Ö—É–π —Ö—É–µ–ø–ª–µ—Ç —Ç—ã —á—Ç–æ –µ–±–∞—Ç—å —Ö—É—è–º–∏ –∑–∞—â–∏—â–∞–µ—à—å—Å—è? –ø–∏–¥–æ—Ä–∞—Å –Ω–∞—Ö—É–π —à–µ–ª –æ—Ç—Å—é–¥–∞ –µ–±–∞—Ç—å —Ç–µ–±—è —â–∞—Å –Ω–∞—á–Ω—É –Ω–∞—Ö—É–π ?? –±–ª—è –º–Ω–µ –ø–æ—Ö—É–π –Ω–∞ —Ç–µ–±—è –¥–∂',
'—è –Ω–∞—Ö—É–π –∫–æ–Ω–≤–µ—Å–∫—É—é —Ç–≤–æ–π —Ä–æ—Ç –∏ –∑–∞—Å—Ç–∞–≤–ª—é —Å–æ—Å–∞—Ç—å –ø–æ–Ω—è—Ç–∏–µ –∏–º–µ–µ—à—å? —è —Ç–≤–æ–π —Ö—É–π –≤ –º—è—Å–æ—Ä—É–±–∫—É —Å—É–≤–∞—Ç—å –±—É–¥—É –∞ –ø–∏–∑–¥—É —Ç–≤–æ–µ–π –º–∞–º–∫–∏ –Ω–∞ –º–æ–π —Ö—É–π) –ø–∏–¥–æ—Ä–∞—Å —Ç—ã –µ–±–∞–Ω—ã–π –æ–¥–Ω–∞–∫–æ',
'—è –Ω–∞—Ö—É–π –ø—Ä–æ—Å—Ç–æ–µ–ª—é —Ç–µ–±–µ –≥–æ–ª–æ–≤—É —Å–ø–µ—Ä–º–æ–π —Ç–≤–æ–µ–≥–æ –¥–µ–¥–∞ –ø–æ–Ω–∏–º–∞–µ—à—å? –±–ª—è—Ç—å —Ç–∞–∫–∏—Ö –∫–∞–∫ —Ç—ã –ø–∏–¥–æ—Ä–∞—Å–æ–≤ —Ç–æ–ª—å–∫–æ –µ–±–∞—Ç—å –Ω–∞–¥–æ ?? —è —Ç–µ–±—è –≤ –¥–æ–±–∞–≤–æ–∫ –µ–±–∞—Ç—å –±—É–¥—É –ø–æ–Ω–∏–º–∞–µ—à—å? —Ö—É–µ—Å–∞—Å –µ–±–∞–Ω—ã–π',
'–±–ª—è –∏–¥–∏ –∫–∞ —Ç—ã –Ω–∞—Ö—É–π –ø–∏–¥–æ—Ä–∞—Å –≥–∞–ª–∏–º—ã–π —è —Ç–µ–±—è –Ω–∞—Ö—É–π –µ–±–∞—Ç—å –±—É–¥—É –ø–æ–Ω–∏–º–∞–µ—à—å? –º–Ω–µ –≤–∞—à–µ –ø–æ—Ö—É–π –Ω–∞ —Ç–≤–æ–∏ —à–ª—é—Ö–∞–Ω—Å–∫–∏–µ –∫–æ–º–ø–ª–µ–∫—Å—ã',
'–∏–¥–∏ –Ω–∞ —Ö—É–π) –±—É–¥—É —è –µ–±–∞–Ω–Ω–æ–º—É –±–∏—á—É –¥–æ–∫–∞–∑—ã–≤–∞—Ç—å) —Å—É–∫–∞ –∏–¥–∏ –ø—Ä–æ–¥–∞–≤–∞–π —Å–≤–æ—é –º–∞—Ç—å, –µ–µ –ø–æ —É–≥–ª–∞–º –µ–±—É—Ç –≤–∏–¥–Ω–æ	',
'—è –µ–±–∞—Ç—å —Ç–µ–±—è —á–∞–π–Ω–∏–∫–æ–º –±—É–¥—É –µ—Å–ª–∏ —Ç—ã –Ω–µ –∑–∞—Ç–∫–Ω–µ—à—å—Å—è –∏ –Ω–µ –±—É–¥–µ—à—å –ø–∏–∑–¥–µ—Ç—å —Ö—É–π–Ω—é –≤—Å—è–∫—É—é –ø–æ–Ω—è—Ç–∏–µ —É —Ç–µ–±—è –µ—Å—Ç—å –ø–∏–¥—Ä–∞—Å? —è —Ç–µ–±—è –Ω–∞—Ö—É–π –µ–±–∞—Ç—å –±—É–¥—É –ø–æ–Ω–∏–º–∞–µ—à—å? ??',
'—Ö—É–µ—Å–æ—Å –µ—Ç—ã –µ–±–∞–Ω–Ω—ã–π –µ–±–∞–ª —Ç–≤–æ—é –º–∞–º–∞—à—É —Å—É–∫–∞ —É —Ç–µ–±—è –Ω–∞ –≥–æ–ª–æ–≤–µ –ø–µ—Ç—É—à–Ω—è —Ç—ã —á–µ –º–µ–Ω—è –≤—ã–º–æ—Ä–∞–∂—Ç–≤–º–≤–µ—à—å —Ö—É–µ—Å–æ—Å –µ–±—É—á–∏–π,–±–ª—è—Ç—å –∑–∞–≤–∞–∏–ª –µ–±–ª–ª–æ —Ö—É–µ—Å–æ—Å –µ–∞–∞–±–Ω–Ω—ã–π —Å–≤–æ–∏ —Å–∫—Ä–∏–Ω—ã –æ—Ç—Ü—É –≤ –∂–æ–ø—É –∑–∞—Å—É–Ω–µ—à—å) –ø–∏–¥–æ—Ä–∞—Å',
'—Ö—É–π–Ω—è –µ–±–∞–Ω–Ω–∞—è —Å–º–æ—Ç—Ä–∏ –∫–∞–∫–∞—è –±–æ–º–±–∞ —â–∞—Å —É–ø–∞–¥–µ—Ç –Ω–∞ –µ–±–ª–æ —Ç–≤–æ–µ, —Ö—É–µ—Å–æ—Å –µ–±–ª–∏–≤—ã–π —è —Ç–µ–±—è –≤—ã–µ–±—É —Ä–∞–∫–æ–º —Ç—ã —á–µ –≤–∑—ä–µ–±—ã–≤–∞–µ—à—å—Å—è, —è 1 —Å–∏–∂—É —Ö—É–µ—Å–æ—Å –µ–±—É—á–∏–π, —è –∂ –Ω–µ –¥–æ–ª–±–æ–µ–± –∫–∞–∫ —Ç—ã —á—Ç–æ–± –¥–∞–≤–∞—Ç—å –ø—Ä–æ—Ñ–∏–ª—å —Å–≤–æ–π –∫–æ–º—É-—Ç–æ, –¥—É—Ä–∞–ª–µ–π —Å—É–∫–∞ –µ–±—É—á–∏–π',
